INSERT INTO `tb_huatai_deposit_desc` (`language_id`, `deposit_id`, `name`, `detail`, `url`, `seo_desc`, `seo_title`, `detail2`, `seo_h1`, `detail3`, `detail4`) VALUES
(1, 2, 'Bank Information -Client Fund Deposit for Futures Trading of China Market ', '<p>After the client has made a wire transfer/ fund deposit to the receiving bank account of Huatai (Hong Kong) Futures Ltd., the client is required to email<span class=&#34;Apple-converted-space&#34;>&nbsp; </span>the copy of the receipt to cs@htfc.com.hk through his registered email address for verification. The receipt provided by the client must clearly show the client&rsquo;s registered bank account number, transfer amount and currency.</p>\r\n<p>The deposit cut-off time is 12:00 noon, and deposits before the cut-off time will be processed within the next working time (T + 1). If the client deposit time exceeds the cut-off time, the deposit will be postponed and processed within the next working day (T+2). (The actual arrival time is based on the bank&#39;s processing time)</p>', '', '', '', '<table class=&#34;client-deposit&#34; style=&#34;width: 1000px;&#34;>\r\n    <thead>\r\n        <tr>\r\n            <td class=&#34;cd-tb-title&#34;>银行名称<br />\r\n            Bank Name</td>\r\n            <td class=&#34;cd-tb-title&#34;>账户名称<br />\r\n            Account Name</td>\r\n            <td class=&#34;cd-tb-title&#34;>币种<br />\r\n            Currency</td>\r\n            <td class=&#34;cd-tb-title&#34;>账户号码<br />\r\n            A/C Number</td>\r\n            <td class=&#34;cd-tb-title&#34;>国际银行代码<br />\r\n            Swift Code</td>\r\n            <td class=&#34;cd-tb-title&#34;>银行地址<br />\r\n            Bank Address</td>\r\n        </tr>\r\n    </thead>\r\n    <tbody>\r\n        <tr>\r\n            <td class=&#34;cd-tb-content&#34;>中国银行（香港）<br />\r\n            Bank of China (Hong Kong) Limited</td>\r\n            <td class=&#34;cd-tb-content&#34;>HUATAI (HONG KONG)<br />\r\n            FUTURES LIMITED<br />\r\n            -NON-HKFE CLIENTS ACCOUNT</td>\r\n            <td class=&#34;cd-tb-content&#34;>人民币CNY</td>\r\n            <td class=&#34;cd-tb-content&#34;>012-875-9-279045-8</td>\r\n            <td class=&#34;cd-tb-content&#34;>BKCHHKHH</td>\r\n            <td class=&#34;cd-tb-content&#34;>香港花园道1号中银大厦<br />\r\n            Bank of China Tower, 1 Garden Road,<br />\r\n            Hong Kong</td>\r\n        </tr>\r\n    </tbody>\r\n</table>', '', '<table class=&#34;client-deposit&#34; style=&#34;width: 1000px;&#34;>\r\n    <thead>\r\n        <tr>\r\n            <td class=&#34;cd-tb-title&#34;>银行名称<br />\r\n            Bank Name</td>\r\n            <td class=&#34;cd-tb-title&#34;>账户名称<br />\r\n            Account Name</td>\r\n            <td class=&#34;cd-tb-title&#34;>币种<br />\r\n            Currency</td>\r\n            <td class=&#34;cd-tb-title&#34;>账户号码<br />\r\n            A/C Number</td>\r\n            <td class=&#34;cd-tb-title&#34;>国际银行代码<br />\r\n            Swift Code</td>\r\n            <td class=&#34;cd-tb-title&#34;>银行地址<br />\r\n            Bank Address</td>\r\n        </tr>\r\n    </thead>\r\n    <tbody>\r\n        <tr>\r\n            <td class=&#34;cd-tb-content&#34;>中国工商银行（亚洲）<br />\r\n            Industrial and Commercial<br />\r\n            Bank of China (Asia) Limited</td>\r\n            <td class=&#34;cd-tb-content&#34; style=&#34;width: 165px;&#34;>HUATAI (HONG KONG)<br />\r\n            FUTURES LIMITED-<br />\r\n            CLIENT ACCOUNT</td>\r\n            <td class=&#34;cd-tb-content&#34;>人民币CNY</td>\r\n            <td class=&#34;cd-tb-content&#34; style=&#34;width: 155px;&#34;>861-530-14974-8</td>\r\n            <td class=&#34;cd-tb-content&#34;>UBHKHKHH</td>\r\n            <td class=&#34;cd-tb-content&#34;>香港中环花园道3号中国工商银行大厦33楼<br />\r\n            33/F, ICBC Tower, 3 Garden Road<br />\r\n            Central, Hong Kong</td>\r\n        </tr>\r\n    </tbody>\r\n</table>', ''),
