INSERT INTO `tb_huatai_download_software_desc` (`language_id`, `download_software_id`, `name`, `detail`, `url`, `seo_desc`, `seo_title`, `detail2`, `seo_h1`) VALUES
(3, 1, '易盛交易系统-易盛手机交易平台', '<p>华泰香港易盛&rdquo;手机交易平台支持Apple及Android系统，提供实时行情报价，助您轻松连接全球期货及期权市场，成为您身边的内外盘交易及套利专家。</p>\r\n<p>特色：</p>\r\n<ul>\r\n    <li>轻松对接全球期货市场，交易品种广泛，实现便利的全球期货产品交易</li>\r\n    <li>实时显示账户资金、权益、成交、持仓信息，与桌面版同步，收益风险尽在掌控</li>\r\n    <li>显示实时、多档报价，显示K线图，可自定义合约组合及报价档位</li>\r\n</ul>', '', '', '', '', ''),
(1, 1, 'Esunny- Mobile Trading Platform', '<p>Huatai Hong Kong Esunny mobile phone trading platform supports Apple and Android systems, provides real-time market quotations, helps you easily connect to the global futures and options market, and assists you in internal and external trading and arbitrage.</p>\r\n<p>Features:</p>\r\n<ul>\r\n    <li>Easily connect to the global futures market, with a wide range of products, to conduct convenient global futures product trading.</li>\r\n    <li>Real-time display of funds, equity, transactions, and position information. Synchronized with the desktop version, the system provides great risk control.&nbsp;</li>\r\n    <li>Display real-time, and multiple quotations. Display K-line graphs, and customize contract combinations and levels of quotations.</li>\r\n</ul>', '', '', '', '', ''),
(1, 2, 'Esunny- Online Software Trading Platform', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Huatai Hong Kong Esunny online software trading system provides clients with a comprehensive trading platform integrating trading, market quotation, and programmatic support.<span class=&#34;Apple-converted-space&#34;>&nbsp;</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;>Features:</p>\r\n<ul class=&#34;ul1&#34;>\r\n    <li class=&#34;li1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Comprehensive coverage of all major exchanges in global futures trading.</li>\r\n    <li class=&#34;li1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Provides real-time market quotation</li>\r\n    <li class=&#34;li1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Supports programmatic trading</li>\r\n    <li class=&#34;li1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Provides multiple quotation levels</li>\r\n    <li class=&#34;li1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Supports market orders, limit orders, stop orders and other common order types</li>\r\n    <li class=&#34;li1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Provides a mobile trading platform to help clients check and trade anytime and anywhere</li>\r\n</ul>', '', '', '', '', ''),
(1, 4, 'TT', '', '', '', '', '', ''),
(3, 4, 'TT交易系统', '', '', '', '', '', ''),
(3, 2, '易盛交易系统-易盛线上交易平台', '<p>华泰香港易盛为您提供交易、行情、程序化一体的综合性交易平台，其主要特点有：</p>\r\n<ul>\r\n    <li>全面覆盖外盘各主流交易所</li>\r\n    <li>提供实时行情查阅功能</li>\r\n    <li>支持程序化交易</li>\r\n    <li>提供多档口报价</li>\r\n    <li>支持市价单、限价单、止损单等各主要单种</li>\r\n    <li>提供手机交易平台，助您随时随地查阅及交易</li>\r\n</ul>', '', '', '', '', ''),
(3, 3, 'ATP交易系统', '<p>华泰香港期货ATP是一套可支持套利程序的交易软件，已于近日上线。ATP 交易系统附带手机交易平台，提供开放API 接口，助力程序化交易， 轻松连接全球期货及期权市场，成为您身边的内外盘套利专家。</p>\r\n<p>​特色：</p>\r\n<ul>\r\n    <li>​轻松对接全球期货及期权市场，实现便利的全球期货产品交易；</li>\r\n    <li>​实时显示账户资金、权益、成交、持仓信息，收益风险了如指掌；</li>\r\n    <li>设定风险参数，掌握下单及持仓风险，满足您的风险管理需求；</li>\r\n    <li>​实时、多档报价，显示K 线图，可自定义合约组合及报价档位；</li>\r\n    <li>支持多类单种，含有自动单功能，可设置止盈止损单、gainbest 单及策略单，通过设置相关参数，获取最大收益；</li>\r\n    <li>自定义设置多种合约组合、多种套利策略，轻松实现跨市场、跨品种、跨期套利。</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>ATP交易客户端，每月20USD的使用收费。如需ATP API授权，请联络您的销售人员或电邮至sales@htfc.com.hk。 手机交易软件下载（解压密码为39161616）：</p>', '', '', '', '', ''),
(1, 3, 'ATP', '<p>Huatai Hong Kong ATP, a set of trading software that supports arbitrage procedures, has been launched recently. The ATP trading system comes with a mobile trading platform. The system provides open API interfaces, facilitates programmatic trading, easily connects to the global futures and options market, and become an arbitrage expert around you.</p>\r\n<p>​Features:</p>\r\n<ul>\r\n    <li>​Easily connects to the global futures and options market and achieve convenient global futures product trading.</li>\r\n    <li>Real-time displays of funds, equity, transaction, and position information assists clients in risk control.</li>\r\n    <li>Provides risk parameters, grasps the risk of placing orders and holding positions, and helps clients in risk management.</li>\r\n    <li>Display real-time and multi-level quotation, K-line chart, customizable contract portfolio and quotation levels.</li>\r\n    <li>Supports multiple types of orders, with automatic order placing function. Clients can set stop orders, gain- best orders and strategic orders, and maximize profit by setting relevant risk parameters.&nbsp;</li>\r\n    <li>​Customize multiple contract combinations and multiple arbitrage strategies to easily conduct cross-market, cross-products, and inter-period arbitrage.</li>\r\n</ul>\r\n<p>Clients who applied ATP trading platform will be charged USD20 per month as the usage fee. For ATP API authorization, please contact your account executive or email to sales@htfc.com.hk.&nbsp;</p>', '', '', '', '', '');
