INSERT INTO `tb_huatai_faq_desc` (`language_id`, `faq_id`, `name`, `detail`, `url`, `seo_desc`, `seo_title`, `detail2`, `seo_h1`) VALUES
(3, 1, '录制见证视频时，客户需明确说出“我已阅读相关开户文件，了解相关风险并自愿开户', '<p>为了确定客户已经完全明白开户的条款和条件，客户需拍摄一段视频，视频中需要需要清晰地说出&ldquo;我已阅读相关开户文件，了解相关风险并自愿开户&rdquo;这段话。拍摄视频时如果一言不发，将会导致开户被退回。</p>', '', '', '', '', ''),
(1, 1, 'When recording the video for witness, the client must clearly state &#34;I have read all the account opening documents, understand all the risks related and would open the account voluntarily&#34;.', '<p>In order to make sure that the client has fully understood the terms and conditions of opening an account, the client is required to take a video, and client need to clearly state that &ldquo;I have read all the relevant account opening documents, understand all the relevant risks, and would open an account voluntarily.&rdquo; If the client do not say a word when shooting the video, the account opening application will be returned.</p>', '', '', '', '', ''),
(1, 4, 'The client put in the card number displayed on a debit card from a Hong Kong bank, rather the correct bank information when fill in the &#34;bank account information&#34; column', '<p>To open a futures account, the client is required to provide his/ her Hong Kong bank account information. The card number displayed on a debit card from a Hong Kong bank is not necessarily the client&rsquo;s account number. If the client fill in the number on the bank debit card in the &quot;Bank Account Information&quot; column of the online account opening system, it may cause the&nbsp; situation that the account number displayed on the official receipt when depositing funds may be inconsistent with the client&rsquo;s input, thus delaying the account opening processing time.</p>\r\n<p>Accurate bank account information can be found in the bank&#39;s account opening certification documents and monthly statements. And clients can also log on to online banking to view relevant information. The bank&rsquo;s account opening certification documents generally include the client&rsquo;s account name (client&rsquo;s name) and account number (the account numbers may be different when the currencies are different). Bank information should be accurately filled in and the certification documents should be uploaded when opening an account.</p>', '', '', '', '', ''),
(3, 4, '“银行账户资料”一栏中填写了银行借记上的号码，并非准确的银行账户信息', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>开立期货账户需要提供香港银行账户的资料。香港的银行借记卡上所显示的卡号，并不一定是客户的账户号码。如果在网上开户系统中</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>&ldquo;</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>银行账户资料</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>&rdquo;</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>这一栏上，填写了银行借记卡上的号码，有可能导致入金时显示的账户号码，与客户输入的并不一致，从而拖延开户的时间。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); min-height: 20px;&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>准确的银行账户信息可以在银行的开户证明文件中查找，客户也可登录网上银行查阅相关资料。银行的开户证明文件一般包括了客户的账户名（客户姓名）及账户号码（不同币种的账户可能号码是不同的），开户时应准确填写并上传证明文件。</span></p>', '', '', '', '', ''),
(3, 5, 'KYC查册时发现Dow Jones数据库、SFC持牌人数据库中的重名纪录', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>在收到客户的开户申请时，我们的审核人员会进行一系列的KYC查册。如果我们发现，在各数据库中有与客户名字相同的同名记录，我们会联络您进行确认。只有在收到您的明确指示&ldquo;并非本人&rdquo;之后，我们才会继续帮您处理开户申请。</span></p>', '', '', '', '', ''),
(1, 5, 'Duplicate records were found in the Dow Jones database and the SFC licensee database when conducting KYC verification. ', '<p>Upon receipt of the client&rsquo;s account opening application, our reviewers will conduct a series of KYC searches. If we find that there are records with the same name as the client&rsquo;s name in each database, we will contact the client to confirm. We will only continue to process the account opening application after receiving the client&rsquo;s clear instruction &quot;not me&quot;.&nbsp;</p>', '', '', '', '', ''),
(3, 6, '入金之后，没有登录系统上传入金凭证，或没有在系统中填写入金资料', '<p><span style=&#34;background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-size: 14px; text-align: justify;&#34;>在初审及合规审核之后，我们会发送短信提示您可以入金10000或以上的港币/等值外币。您入金之后，请记得重新登录系统上传入金凭证，以证明您的入金是来自于您在网上开户时登记过的银行账户。我们需要查到您入金到账，成功核实是来自于您开户时登记的银行账户，才可以帮您继续办理开户。</span>&nbsp;</p>', '', '', '', '', ''),
(1, 6, 'After depositing, the client did not log in to the system to upload the receipt, or did not put in the deposit information in the system', '<p>After the preliminary review and compliance review, we will send a text message to remind the client that he/she is required deposit HKD10,000 or more in equivalent foreign currency. After the client&rsquo;s deposit, he/she is reminded to log in to the account opening system again to upload the deposit certificate to prove that the deposit came from the bank account that the client has registered when he/she make the online account opening application in the beginning. We need to check that the client&rsquo;s deposit has been received, and verify that the deposit is from the bank account that the client has registered in the beginning, before we can help to continue the account opening process.</p>', '', '', '', '', ''),
(1, 2, 'What currencies are accepted for fund deposit?', '<p>We can accept client deposits in HKD, USD, RMB, Euro, and JPY.</p>', '', '', '', '', ''),
(3, 2, '账户可接受哪些币种入金？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>我们可以接受客户存入港币、美金、人民币、欧元、日币。</span></p>', '', '', '', '', ''),
(3, 7, '账户可否接受现金存款？可否接受第三者存款？', '<p><span style=&#34;background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-size: 14px;&#34;>收到存款时，我们将仔细核对汇款人名称、账号是否与客户姓名及登记账号一致，不接纳客户本人以外的第三方存款。更不会接受联名银行账户的入金汇款。如果汇款人并非我们的客户，我们不能接受。与此同时我们也不接受现金存款。</span></p>', '', '', '', '', ''),
(1, 7, 'Are cash deposits or third party deposits acceptable?', '<p>When receiving the deposit, we will carefully check whether the remitter&rsquo;s name and account number are consistent with the client&rsquo;s name and registered account number, and will not accept third-party deposits other than the client. We will not accept deposits and remittances from joint bank accounts. If the sender is not our client, we cannot accept it. At the same time, we do not accept cash deposits.</p>', '', '', '', '', ''),
(3, 8, '网上开户入金，还有哪些问题需要注意？', '<p><span style=&#34;background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-size: 14px;&#34;>应保留入金凭证（网银截图、手机银行截图、汇款底单等），重新登录网上开户系统填写入金资料并上传入金截图。请注意仔细填写，我们会核对入金凭证需显示开户人的账户号码及入金金额，账户号码需和开户时提供的账户号码完全一致。</span></p>', '', '', '', '', ''),
(2, 8, '网上开户入金，还有哪些问题需要注意？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>应保留入金凭证（网银截图、手机银行截图、汇款底单等），重新登录网上开户系统填写入金资料并上传入金截图。请注意仔细填写，我们会核对入金凭证需显示开户人的账户号码及入金金额，账户号码需和开户时提供的账户号码完全一致。</span></p>', '', '', '', '', ''),
(1, 8, '网上开户入金，还有哪些问题需要注意？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>应保留入金凭证（网银截图、手机银行截图、汇款底单等），重新登录网上开户系统填写入金资料并上传入金截图。请注意仔细填写，我们会核对入金凭证需显示开户人的账户号码及入金金额，账户号码需和开户时提供的账户号码完全一致。</span></p>', '', '', '', '', ''),
(3, 9, '入金操作的具体流程是怎样的？', '<p><span style=&#34;background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-size: 14px;&#34;>您需转账至本公司在中国银行（香港）及工银亚洲的账户中，汇款资料请见&ldquo;资金存取&rdquo;页面。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); min-height: 20px;&#34;>&nbsp;</p>\r\n<p class=&#34;p3&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s2&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>请确保填写的收款人信息完全正确。如填写错误，可能就会导致汇款退回，耽误您宝贵的时间及投资的机会。</span></p>\r\n<p class=&#34;p4&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;><span class=&#34;s2&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>请保留汇款收据（如果是经过网上银行汇款，请保留汇款截图），并及时通知我们有关客户姓名、账号、转账时间及金额。</span></p>\r\n<p class=&#34;p4&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;><span class=&#34;s2&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>您可：</span></p>\r\n<p class=&#34;p5&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34;><span class=&#34;s3&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; pingfang=&#34; font-kerning:=&#34; background-color:=&#34;&gt;致电本公司客服热线：&lt;/span&gt;&lt;span class=&#34;>+852 39161616</span></p>\r\n<p class=&#34;p6&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34;><span class=&#34;s4&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; pingfang=&#34; font-kerning:=&#34; color:=&#34; background-color:=&#34;>联络交易及客服邮箱：</span><span class=&#34;s5&#34; style=&#34;text-decoration-line: underline; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>dealing@htfc.com.hk</span></p>\r\n<p class=&#34;p5&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34;><span class=&#34;s3&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; pingfang=&#34; font-kerning:=&#34; background-color:=&#34;&gt;传真：&lt;/span&gt;&lt;span class=&#34;>+852 39161699</span></p>\r\n<p class=&#34;p4&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;><span class=&#34;s2&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>我们专业的交易及客服人员在收到客户指示后将尽快处理客户的入金请求。</span></p>\r\n<p class=&#34;p4&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;><span class=&#34;s2&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>注意事项：</span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>电汇时银行将收取一定费用，您需要参阅相关银行资料，以免产生误会。</span></p>', '', '', '', '', ''),
(1, 9, 'What is the specific process of the fund deposit?', '<p>The Client need to transfer funds to our company&#39;s accounts in Bank of China (Hong Kong) and ICBC (Asia). For remittance information, please see the &quot;Fund Deposits and Withdrawal&quot; page.</p>\r\n<p>Please make sure that the payee information is completely accurate. If the client does not provide the correct information when depositing, it may cause the remittance to be returned, so that it may cause time delay and lost in investment opportunities.</p>\r\n<p>Please keep the remittance receipt (if the remittance is done via online banking, please keep the screenshot of the remittance), and promptly inform us about the client&rsquo;s name, account number, transfer time and amount.</p>\r\n<p>Clients may contact:</p>\r\n<p>CS hotline: +852 39161616</p>\r\n<p>Dealing and CS email: dealing@htfc.com.hk</p>\r\n<p>Fax: +852 39161699</p>\r\n<p>Our dealing and customer service team will process the client&rsquo;s deposit request as soon as possible after receiving the client&rsquo;s instruction.</p>\r\n<p>Precautions:</p>\r\n<p>The bank may charge a certain fee when the client is making a wire transfer. Clients are encouraged to refer to the relevant bank information to avoid misunderstandings.</p>', '', '', '', '', ''),
(3, 10, '转账入金需时多久才可收到？', '<p><span class=&#34;s1&#34; style=&#34;color: rgb(51, 51, 51); font-size: 14px; font-kerning: none;&#34;>一般香港本地银行于周一至周五上午</span><span class=&#34;s2&#34; style=&#34;color: rgb(51, 51, 51); font-size: 14px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>9</span><span class=&#34;s1&#34; style=&#34;color: rgb(51, 51, 51); font-size: 14px; font-kerning: none;&#34;>时到下午</span><span class=&#34;s2&#34; style=&#34;color: rgb(51, 51, 51); font-size: 14px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>5</span><span class=&#34;s1&#34; style=&#34;color: rgb(51, 51, 51); font-size: 14px; font-kerning: none;&#34;>时工作</span><span class=&#34;s2&#34; style=&#34;color: rgb(51, 51, 51); font-size: 14px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>, </span><span class=&#34;s1&#34; style=&#34;color: rgb(51, 51, 51); font-size: 14px; font-kerning: none;&#34;>存款银行操作可在该段时间内进行。我们的截数时间为香港时间下午4时，所有于下午4时后收到的入金通知，都会顺延至第二个工作天处理。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; pingfang=&#34; sc=&#34; color:=&#34; background-color:=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>我们只会在确认银行账户收到您的全部入金款项后才开始处理；您汇款至到账的时间，则会根据银行的具体操作而有所不同。</span></p>', '', '', '', '', ''),
(1, 10, 'How long does it take to receive the transfer/ deposit?', '<p>Generally, local banks&rsquo;s working time in Hong Kong is from 9 am to 5 pm , Monday to Friday, and deposit can be made during this period. Our cut-off time is 4 pm Hong Kong time. All deposit notifications received after 4 pm will be postponed to the second working day for processing.</p>\r\n<p>We will only start fund- in processing after confirming that our bank account has received all of the client&rsquo;s deposit. The time for clients&rsquo; remittance to arrive may vary according to the operation of the bank.</p>', '', '', '', '', ''),
(3, 11, '入金汇款可否在交易软件上完成？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>很抱歉，我们暂未有此项功能，您需要使用银行转账并通知我们。</span></p>', '', '', '', '', ''),
(2, 11, '入金汇款可否在交易软件上完成？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>很抱歉，我们暂未有此项功能，您需要使用银行转账并通知我们。</span></p>', '', '', '', '', ''),
(1, 11, '入金汇款可否在交易软件上完成？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>很抱歉，我们暂未有此项功能，您需要使用银行转账并通知我们。</span></p>', '', '', '', '', ''),
(1, 12, 'If the currency held in the account is different from the settlement currency of the product that I intend to trade, do I need to exchange foreign currency  in the bank in advance?', '<p>Not necessary. Clients can contact us to exchange foreign currency and transfer the funds held in the client&rsquo;s account to another currency.</p>', '', '', '', '', ''),
(3, 12, '若账户中持有的币种与打算交易产品的结算币种不同，是否需要提前去银行换汇之后再入金交易呢？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>不需要。您可联络本公司进行换汇，将客户账户内持有的资金转为另一币种。</span></p>', '', '', '', '', ''),
(3, 13, '换汇操作的具体流程是怎样的？', '<p><span style=&#34;background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-size: 14px;&#34;>您可以：</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34;><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; pingfang=&#34; font-kerning:=&#34; background-color:=&#34;&gt;致电本公司交易热线：&lt;/span&gt;&lt;span class=&#34;>联络交易电话+852 39161616</span></p>\r\n<p class=&#34;p3&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34;><span class=&#34;s3&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; pingfang=&#34; font-kerning:=&#34; color:=&#34; background-color:=&#34;>联络交易邮箱：</span><span class=&#34;s4&#34; style=&#34;text-decoration-line: underline; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>dealing@htfc.com.hk</span><span class=&#34;s5&#34; style=&#34;font-kerning: none; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;>&nbsp;</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34;><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; pingfang=&#34; font-kerning:=&#34; background-color:=&#34;&gt;传真：&lt;/span&gt;&lt;span class=&#34;>传真至：+85239161699</span></p>\r\n<p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;><span class=&#34;s6&#34; style=&#34;font-kerning: none;&#34;>我们专业的交易服务人员在收到您的指示后将尽快处理您的入金请求。我们的每笔换汇于下午2点为截数时间，所有于下午2时后收到的换汇通知，均顺延至第二个工作天处理。</span></p>', '', '', '', '', ''),
(1, 13, 'What&#39;s the procedure of currency exchange?', '<p>Clients may contact:&nbsp;</p>\r\n<p>CS hotline: +852 39161616</p>\r\n<p>Dealing and CS email: dealing@htfc.com.hk</p>\r\n<p>Fax: +852 39161699</p>\r\n<p>Our cut-off time is 2 pm Hong Kong time. All FX Request received after 2 pm will be postponed to the second working day for processing.&nbsp;</p>', '', '', '', '', ''),
(3, 14, '若我账户中持有的币种与打算交易产品的结算币种不同，可否直接买入/卖出该交易品种？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>例如：账户中仅持有美金，而该客户想直接交易恒生指数期货。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;><span class=&#34;s2&#34; style=&#34;font-kerning: none;&#34;>只要开仓时账户内有足够权益，客户依然可以直接交易，但交易的隔天会收到换汇确认对账单，表示客户默认由本公司为其执行换汇。也就是说，如客户没有要求，系统会自动根据银行汇率为客户执行换汇。</span></p>', '', '', '', '', ''),
(1, 14, 'If the currency held in my account is different from the settlement currency of the product I intend to trade, can I directly buy/sell the trading product?', '<p>For example: there is only USD- based equity in the trading account, and the client wants to directly trade Hang Seng Index futures.</p>\r\n<p>As long as there is sufficient equity in the account when opening a position, the client can still trade directly, but the FX confirmation statement will be received the next day, indicating that the client defaults to us to execute the exchange. In other words, if the customer does not require a certain FX rate, the system will automatically execute the FX for the client based on the exchange rate of the bank.</p>', '', '', '', '', ''),
(3, 15, '换汇可否在交易软件上完成？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>很抱歉，我们暂未有此项功能，您需要使用银行转账并通知我们。</span></p>', '', '', '', '', ''),
(2, 15, '换汇可否在交易软件上完成？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>很抱歉，我们暂未有此项功能，您需要使用银行转账并通知我们。</span></p>', '', '', '', '', ''),
(1, 15, '换汇可否在交易软件上完成？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>很抱歉，我们暂未有此项功能，您需要使用银行转账并通知我们。</span></p>', '', '', '', '', ''),
(3, 16, '可否提供第三者账户，直接出到该账户上？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>很抱歉，不可以。我们在收到出金申请时，将仔细核对收款人名称及账户号码是否与客户姓名及登记账号一致，不接受出金到除客户本人以外的第三方账户。</span></p>', '', '', '', '', ''),
(1, 16, 'Can I provide a third-party account and request Huatai to transfer my fund to that account?', '<p>Unfortunately, no. When we receive the withdrawal request, we will carefully check whether the payee&#39;s name and account number are consistent with the client&rsquo;s name and his/ her registered account number. We do not process withdrawal request to third-party accounts other than the client.</p>', '', '', '', '', ''),
(1, 17, 'What&#39;s the procedure of fund out?', '<p>You can:</p>\r\n<p>(1) Send the withdrawal instructions to dealing@htfc.com.hk from the email address registered when opening the account.</p>\r\n<p>(2) Call (852) 39161616 and contact our dealing and CS team.</p>\r\n<p>(3) Fill in the Fund Withdrawal Form (downloadable on the company&#39;s official website www.htfc.com.hk homepage), sign on it and email to us. Our CS team will verify your identity and signature. After checking the remaining funds in the client&rsquo;s account, we will process the fund withdrawal.</p>\r\n<p>Generally, local banks&rsquo;s working time in Hong Kong is from 9 am to 5 pm , Monday to Friday, and withdrawal request can be&nbsp; during this period. Our cut-off time is 12pm Hong Kong time. All deposit notifications received after 12pm will be postponed to the second working day for processing.</p>', '', '', '', '', ''),
(3, 17, '出金操作的具体流程是怎样的？', '<p><span style=&#34;background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-size: 14px;&#34;>您可通过：</span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>（1）&nbsp;由开户时登记的电邮地址发送出金指示至dealing@htfc.com.hk</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); min-height: 20px;&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>（2）&nbsp;致电（852）39161616，和本公司交易及客户服务人员联络</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); min-height: 20px;&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>（3）&nbsp;填写出金表格（可在本公司官网</span><span class=&#34;s3&#34; style=&#34;text-decoration-line: underline; font-kerning: none; color: rgb(5, 99, 193); background-color: rgb(255, 255, 255);&#34;>www.htfc.com.hk</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>主页下载）并签署的方式向我们提出出金申请，我们专业的客服人员在确认您的签名或核对身份、确认账户内剩余资金之后，帮您办理出金。</span></p>\r\n<p class=&#34;p3&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; color: rgb(51, 51, 51); min-height: 24px;&#34;>&nbsp;</p>\r\n<p class=&#34;p4&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s2&#34; style=&#34;font-kerning: none;&#34;>一般香港本地银行于周一至周五上午9时到下午5时工作，您的出金申请可在该段时间内进行。我们的截数时间为中午12时，所有于中午12时后收到的出金通知，都会顺延至第二个工作天处理。</span></p>', '', '', '', '', ''),
(1, 3, 'Why does it prompt &#34;Login Limits Exceeds&#34;?', '<p>The client&rsquo;s account can only be logged in from the same IP address, and must not be logged in from multiple IP addresses at the same time. In other words, if the client has logged in to the trading system on one device and he/ she tries to log in in another device without logging out the account he/ she just logged in, the system will prompt that notice.</p>\r\n<p>When logging in, please select the server closest to you. If such an error occurs when you choose the Hong Kong server, you can try to use the Shanghai server.</p>', '', '', '', '', ''),
(3, 3, '为何登录易盛交易系统时，会提示“登录数量超限”？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>客户的账户只能从同一</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34; background-color:=&#34;&gt;IP&lt;/span&gt;&lt;span class=&#34;>地址登录，不得同时从多个地址登录，换而言之，如果客户已经在一台电脑上登录了交易系统，在没有退出登录的前提下，又尝试在别的电脑上登录，就会遇到登陆数量超限的提示。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;><span class=&#34;s3&#34; style=&#34;font-kerning: none;&#34;>登录时请选择距离您最近的服务器，如果选用香港服务器时出现此类报错，可以试试选用上海服务器。</span></p>', '', '', '', '', ''),
(3, 18, '易盛交易系统显示账户冻结，登录不上', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>若连续</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>3</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>次输错密码，账户将会被冻结。您需谨慎保管好自己的密码，并定期修改，以保证账户的安全。</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>若账户被冻结，您可随时联络本公司交易室（</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>+852 39161616/ </span><span class=&#34;s3&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; text-decoration-line:=&#34; font-kerning:=&#34; color:=&#34;>dealing@htfc.com.hk</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>）要求解冻，在确认客户的身份之后，交易服务团队会帮助客户重置密码。您需要定时修改密码，这样有助于您的账户安全。</span></p>', '', '', '', '', ''),
(1, 18, 'Esunny trading system shows that the account is frozen and cannot be logged in', '<p>If the client enter the wrong password three times continuously,&nbsp; his/ her account will be frozen. The client is reminded to keep the password carefully and modify it regularly to ensure the security of the futures account. If the account is frozen, the client can always contact the our dealing team (+852 39161616/ dealing@htfc.com.hk) to request unfreezing. After confirming the customer&#39;s identity, the dealing will help the client reset the password. Clients are encouraged to change the password regularly.</p>', '', '', '', '', ''),
(3, 19, '什么是双重认证？为何要输入双重认证码之后方可登录？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>为使客户于使用网上交易系统时得到更好保障，我们已经从</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>2018</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>年</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>4</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>月</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>9</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>日开始按照监管要求启用网上保安措施</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>&nbsp;:</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>「双重认证」。当您登陆时，系统会发出一条一次性验证密码，除了输入原有的密码外，您也需要输入通过在本公司登记的手机号码所收到的验证码，以尽可能提升网上交易的安全性。请注意，由于我们的系统仅向已登记手机发送验证码，如手机号码有所变更，应尽快联络我们更新信息，以免收不到验证码而影响正常交易。</span></p>', '', '', '', '', ''),
(1, 19, 'What is two-factor authentication? Why do I have to enter the two-factor authentication code before logging in?', '<p>In order to provide customers with better protection when using the online trading system, we have activated online security protection steps in accordance with regulatory requirements, which is two-factor authentication, from April 9, 2018. When the client logs in, the system will issue a one-time verification password. In addition to entering the original password, the client also need to enter the verification code received through the mobile phone number registered with the company to ensure the security of online transactions. Please note that since our system only sends verification codes to registered mobile phones, if the mobile phone number is changed, clients should contact us to update the information as soon as possible.</p>', '', '', '', '', ''),
(3, 20, '可否修改收取二次认证验证码的方式？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>我们的系统预设客户是通过手机短信（</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34;>SMS</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>）的方式收取二次认证码进行登录。如您想更换收取方式，也可以向本公司提出要求，申请更改为通过电邮的方式收取二次认证码；反之亦然。</span></p>', '', '', '', '', ''),
(1, 20, 'Can I modify the method of receiving the verification code for the two-factor authentication? ', '<p>Our system presupposes that customers log in by receiving a two-factor authentication code via mobile phone text messages (SMS). If you want to change the receiving method, you can also request to receive the secondary authentication code via email; and vice versa.</p>', '', '', '', '', ''),
(1, 21, 'How to apply to view real-time exchange quotations?', '<p>There is a charge for viewing real-time market quotations; if the client need to view the real-time market data, please log in to the market information interface in Esunny trading system, click &quot;Pay&quot;, and subscribe the market data according to the guidance.</p>\r\n<p>For a detailed introduction to market charges, please refer to the section on market quotes in the &quot;Notices&rdquo; on the homepage of our company&#39;s website.</p>', '', '', '', '', ''),
(3, 21, '如何申请查阅实时交易所行情？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>浏览实时行情是需要收费的；如需查阅实时行情，请需登录行情界面，点击</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34; background-color:=&#34;&gt;&ldquo;&lt;/span&gt;&lt;span class=&#34;>行情付费</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &#34; helvetica=&#34; font-kerning:=&#34; background-color:=&#34;&gt;&rdquo;&lt;/span&gt;&lt;span class=&#34;>，根据指引进行订阅。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; helvetica=&#34; color:=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p&gt;&lt;span style=&#34; background-color:=&#34; color:=&#34; font-size:=&#34; text-align:=&#34;>有关行情收费的详细介绍，请参阅本公司网站主页中&ldquo;重要通告&rdquo;内关于行情的部分。&nbsp;</p>', '', '', '', '', ''),
(1, 22, 'What types of orders does the mobile trading system support?', '<p>Esunny mobile trading system supports limit orders and market orders. Orders can be placed and cancelled. Order modification is not supported currently. The ATP mobile trading system supports a variety of strategic orders.</p>', '', '', '', '', ''),
(3, 22, '手机交易系统支持哪些类型的单？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>易盛手机交易系统支持限价单、市价单的交易。可下单、撤单，暂不支持改单。ATP手机交易系统支持多种策略单。</span></p>', '', '', '', '', ''),
(3, 23, '可否接受API电子交易？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>本公司可接受</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none;&#34;>API</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>电子交易。您可以事先与我们确认您自身的</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none;&#34;>API</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>接口与和我们交易平台的接入是否通畅，并需签署风险同意书，在我们批核之后，就可以进行相应的API连接。</span></p>', '', '', '', '', ''),
(2, 23, '可否接受API电子交易？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>本公司可接受</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none;&#34;>API</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>电子交易。您可以事先与我们确认您自身的</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none;&#34;>API</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>接口与和我们交易平台的接入是否通畅，并需签署风险同意书，在我们批核之后，就可以进行相应的API连接。</span></p>', '', '', '', '', ''),
(1, 23, '可否接受API电子交易？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>本公司可接受</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none;&#34;>API</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>电子交易。您可以事先与我们确认您自身的</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none;&#34;>API</span><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>接口与和我们交易平台的接入是否通畅，并需签署风险同意书，在我们批核之后，就可以进行相应的API连接。</span></p>', '', '', '', '', ''),
(3, 24, 'LME调期平仓如何操作？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>因</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>LME</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>产品是以远期合约形式交易，有别于一般期货产品的每月只有制定一个交割日（</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>prompt date</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>）的情况，</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>LME</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>产品每个工作日均可以是交割日，不同交易日成交的合约交割日均不同。因此，要达至平仓目的，必须做一套调期交易（</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>carry trade</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>）方可对销不同交割日的长短仓位。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; color: rgb(51, 51, 51); min-height: 20px;&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>除了即日买卖或相同交割日的长短仓合约可直接平仓外，否则于不同交易日成交的长短仓合约是不会自动平仓的，因此有平仓需求的您需要主动提出平仓调期的要求，否则我们的交易员将会在适当时间主动致电您，向您报告平仓掉期交易价格，提醒您及时处理仓位。所以，要平仓的话，您需要先在期货交易平台买入或卖出持仓产品的反方向</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>3</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>个月合约，之后再联络我们交易部进行调期手续。所有平仓调期交易的价格是根据当时该产品的升水或贴水而厘定，而有关升水或贴水则因应市场供需而变化。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; color: rgb(51, 51, 51); min-height: 20px;&#34;>&nbsp;</p>\r\n<p class=&#34;p3&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s3&#34; style=&#34;font-kerning: none;&#34;>所有LME合约在交割日方能完全平仓，在交割日前所有交易仍然会记录在结单上。所有盈利在到期日前不可提取，只能作为保证金之用。</span></p>', '', '', '', '', '');
INSERT INTO `tb_huatai_faq_desc` (`language_id`, `faq_id`, `name`, `detail`, `url`, `seo_desc`, `seo_title`, `detail2`, `seo_h1`) VALUES
(2, 24, 'LME调期平仓如何操作？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>因</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>LME</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>产品是以远期合约形式交易，有别于一般期货产品的每月只有制定一个交割日（</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>prompt date</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>）的情况，</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>LME</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>产品每个工作日均可以是交割日，不同交易日成交的合约交割日均不同。因此，要达至平仓目的，必须做一套调期交易（</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>carry trade</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>）方可对销不同交割日的长短仓位。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; color: rgb(51, 51, 51); min-height: 20px;&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>除了即日买卖或相同交割日的长短仓合约可直接平仓外，否则于不同交易日成交的长短仓合约是不会自动平仓的，因此有平仓需求的您需要主动提出平仓调期的要求，否则我们的交易员将会在适当时间主动致电您，向您报告平仓掉期交易价格，提醒您及时处理仓位。所以，要平仓的话，您需要先在期货交易平台买入或卖出持仓产品的反方向</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>3</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>个月合约，之后再联络我们交易部进行调期手续。所有平仓调期交易的价格是根据当时该产品的升水或贴水而厘定，而有关升水或贴水则因应市场供需而变化。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; color: rgb(51, 51, 51); min-height: 20px;&#34;>&nbsp;</p>\r\n<p class=&#34;p3&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s3&#34; style=&#34;font-kerning: none;&#34;>所有LME合约在交割日方能完全平仓，在交割日前所有交易仍然会记录在结单上。所有盈利在到期日前不可提取，只能作为保证金之用。</span></p>', '', '', '', '', ''),
(1, 24, 'LME调期平仓如何操作？', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>因</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>LME</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>产品是以远期合约形式交易，有别于一般期货产品的每月只有制定一个交割日（</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>prompt date</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>）的情况，</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>LME</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>产品每个工作日均可以是交割日，不同交易日成交的合约交割日均不同。因此，要达至平仓目的，必须做一套调期交易（</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>carry trade</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>）方可对销不同交割日的长短仓位。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; color: rgb(51, 51, 51); min-height: 20px;&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>除了即日买卖或相同交割日的长短仓合约可直接平仓外，否则于不同交易日成交的长短仓合约是不会自动平仓的，因此有平仓需求的您需要主动提出平仓调期的要求，否则我们的交易员将会在适当时间主动致电您，向您报告平仓掉期交易价格，提醒您及时处理仓位。所以，要平仓的话，您需要先在期货交易平台买入或卖出持仓产品的反方向</span><span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-kerning: none; background-color: rgb(255, 255, 255);&#34;>3</span><span class=&#34;s1&#34; style=&#34;font-kerning: none; background-color: rgb(255, 255, 255);&#34;>个月合约，之后再联络我们交易部进行调期手续。所有平仓调期交易的价格是根据当时该产品的升水或贴水而厘定，而有关升水或贴水则因应市场供需而变化。</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 17px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; color: rgb(51, 51, 51); min-height: 20px;&#34;>&nbsp;</p>\r\n<p class=&#34;p3&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);&#34;><span class=&#34;s3&#34; style=&#34;font-kerning: none;&#34;>所有LME合约在交割日方能完全平仓，在交割日前所有交易仍然会记录在结单上。所有盈利在到期日前不可提取，只能作为保证金之用。</span></p>', '', '', '', '', ''),
(3, 25, '大额持仓申报标准为何？', '<p>不同交易所及监管机构对大额持仓申报标准不同，具体请参考交易所网站：</p>\r\n<p>HKEX：https://www.hkex.com.hk/Services/Trading/Derivatives/Overview/Trading-Mechanism/Large-Open-Positions-and-Position-Limits?sc_lang=en</p>\r\n<p>CME：https://www.cmegroup.com/market-regulation/position-limits.html#</p>\r\n<p>CFTC：https://www.ecfr.gov/current/title-17/chapter-I/part-15/section-15.03</p>', '', '', '', '', ''),
(1, 25, 'Whats is the regulation on large open positions and position limits?', '<p>Regulations on large open positions and position limits differ among exchanges and regulating authorities. Please check the webistes of exchanges and regulating authorities for details.&nbsp;</p>\r\n<p>HKEX：https://www.hkex.com.hk/Services/Trading/Derivatives/Overview/Trading-Mechanism/Large-Open-Positions-and-Position-Limits?sc_lang=en</p>\r\n<p>CME：https://www.cmegroup.com/market-regulation/position-limits.html#</p>\r\n<p>CFTC：https://www.ecfr.gov/current/title-17/chapter-I/part-15/section-15.03</p>', '', '', '', '', ''),
(1, 26, 'Where can I find investor education links from the exchanges?', '<p>CME Investor Education</p>\r\n<div>https://www.cmegroup.com/education.html</div>\r\n<div>&nbsp;</div>\r\n<div>ICE Investor Education</div>\r\n<div>https://www.theice.com/support/education</div>\r\n<div>&nbsp;</div>\r\n<div>SGX Investor Education</div>\r\n<div>https://www.sgx.com/research-education</div>\r\n<div>&nbsp;</div>\r\n<div>IFEC Investor Education</div>\r\n<div>https://www.ifec.org.hk/web/tc/index.page</div>\r\n<div>&nbsp;</div>\r\n<div>HKICC</div>\r\n<div>https://www.hkicc.org.hk/about_us/introduction_c.htm</div>\r\n<div>&nbsp;</div>\r\n<div>www.investor.org.cn</div>\r\n<div>https://www.investor.org.cn/</div>\r\n<div>&nbsp;</div>\r\n<div>Securities and futures law database</div>\r\n<div>https://neris.csrc.gov.cn/falvfagui/</div>', '', '', '', '', ''),
