(3, 3, '华泰（香港）期货有限公司成为首家获得INE境外特殊经纪参与者资格之期货商', '<p>华泰（香港）期货有限公司成为首家获得INE境外特殊经纪参与者资格之期货商</p>\r\n<p>上海及香港时间，2020年8月4日上海国际能源交易中心近日宣布，经董事会批准，华泰（香港）期货有限公司（&ldquo;下称华泰（香港）期货&rdquo;）正式被接受为上海国际能源交易中心境外特殊经纪参与者。华泰（香港）期货有限公司为上海国际能源交易中心正式批准的首家境外特殊经纪参与者。</p>\r\n<p>境外特殊参与者是指符合中国证券监督管理委员会及能源中心规定条件，经能源中心审核批准，在能源中心直接入场交易的境外中介机构。境外特殊经纪参与者可按照规定委托会员在能源中心进行清算、交割及仓单质押等业务；此外，境外特殊经纪参与者可以使用能源中心提供的交易设施，获得有关期货交易的信息和服务。</p>\r\n<p>华泰（香港）期货有限公司副总经理、销售负责人员陈伯龙表示，作为首家境外特殊经纪参与者，华泰（香港）期货可以为香港及境外实体企业参与中国特定品种（如原油、国际铜、20号橡胶）提供直连交易、多币别清算和实物交割等优质的金融服务。我们相信，随着中国期货市场国际化进程的推进，越来越多的海外的有套期保值风险管理需求的实体企业、有着丰富交易策略的海外专业投资者将率先直接参与到中国商品市场的交易机会。凭借着华泰期货在中国期货市场领先的市场地位，华泰香港期货有限公司可为投资者实现市场领先的交易清算执行方案。</p>\r\n<p>根据上海国际能源交易中心公布数据显示，截至10月12日，按单边统计，原油期货累积成交量1463.7万手，成交金额7.32万亿元。单日成交量平均10.92万手，最高达21.12万手；单日持仓量平均1.59万手，最高达到2.5万手；单日成交金额平均546.09亿元，最高达到1232.3亿元。上海能源中心交易所将继续以&ldquo;国际平台、净价交易、保税交割、人民币计价&rdquo;为基本思路，稳步推进期货市场国际化的步伐。</p>', '', '', '', '', ''),
(2, 3, '華泰（香港）期貨有限公司成為首家獲得INE境外特殊經紀參與者資格之期貨商', '<p>上海及香港時間，2020年8月4日-上海國際能源交易中心近日宣布，經董事會批准，華泰（香港）期貨有限公司（&ldquo;下稱華泰（香港）期貨&rdquo;）正式被接受為上海國際能源交易華泰（香港）期貨有限公司為上海國際能源交易中心正式批准的首家境外特殊經紀人參與。</p>\r\n<p>境外特殊參與者是指符合中國證券監督管理委員會及能源中心規定的條件，經能源中心審核批准，在能源中心直接入場交易的境外中介機構。境外特殊經紀人可以按照規定委託會員在能源中心進行清算，交割及倉單質押等業務；以及，境外特殊經紀參與者可以使用能源中心提供的交易設施，獲得有關期貨交易的信息和服務。</p>\r\n<div>\r\n<div>华泰（香港）期货有限公司副總經理、銷售负责人員陳伯龍表示，作为首家境外特殊经纪参与者，华泰（香港）期货可以为香港及境外實體企業参与中國特定品種（如原油、國際銅、20號橡膠）提供直連交易、多幣別清算和實物交割等優質的金融服務。我們相信，隨著中國期貨市場國際化進程的推進，越來越多的海外的有套期保值风险管理需求的实体企业、有著豐富交易策略的海外專業投資者將率先直接參與到中国商品市场的交易机会。憑藉著華泰期貨在中國期貨市場領先的市場地位，華泰香港期貨有限公司可為投资者实现市場領先的交易清算执行方案。</div>\r\n<div>&nbsp;</div>\r\n<div>根據上海国际能源交易中心公布數據顯示，截至10月12日，按單邊統計，原油期貨累積成交量1463.7萬手，成交金額7.32萬億元。單日成交量平均10.92萬手，最高達21.12萬手；單日持倉量平均1.59萬手，最高達到2.5萬手；單日成交金額平均546.09億元，最高達到1232.3億元。上海能源中心交易所將繼續以&ldquo;國際平台、淨價交易、保稅交割、人民幣計價&rdquo;為基本思路，穩步推進期貨市場國際化的步伐。</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<div>關於華泰（香港）期貨有限公司</div>\r\n<div>&nbsp;</div>\r\n<div>華泰（香港）期貨有限公司是華泰期貨根據中國證監會批复，於2015年在香港特別行政區註冊成立。華泰（香港）期貨為參與全球市場的機構客戶提供24小時不間斷的全球市場的期貨合約交易服務。華泰（香港）期貨可憑藉其深耕中國市場及匯集全球資深投資人的豐富經驗，為廣大專業及機構投資者提供綜合性及量身定制的交易執行方案。</div>\r\n</div>\r\n</div>', '', '', '', '', ''),
(1, 3, 'Huatai (Hong Kong) Futures Limited being the first Futures Brokerage to be granted the Qualification of the Overseas Special Brokerage Participant to Shanghai International Energy Exchange', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 24px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>Huatai (Hong Kong) Futures Limited being the first Futures Brokerage to be granted the Qualification of the Overseas Special Brokerage Participant to Shanghai International Energy Exchange</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;><br />\r\n</span></p>\r\n<p class=&#34;p3&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0); min-height: 16px;&#34;>&nbsp;</p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>Shanghai &amp; Hong Kong&nbsp;Time, Aug 4, 2020- Shanghai International Energy Exchange (&ldquo;the Exchange&rdquo;) announced that, as approved by board of directors, Huatai (Hong Kong) Futures Limited is officially recognized as an Overseas Special Brokerage Participant (&ldquo;OSBP&rdquo;) to the Exchange. Huatai (Hong Kong) Futures Limited is the first OSBP approved and recognized by the Exchange.</span></p>\r\n<p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;><br />\r\n</span></p>\r\n<p class=&#34;p5&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0); min-height: 16px;&#34;>&nbsp;</p>\r\n<p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>An Overseas Special Participant is an overseas institution that satisfies the prescribed conditions of China Securities Regulatory Commission (&ldquo;CSRC&rdquo;) and the Exchange,&nbsp;and are approved by the Exchange to trade directly at the Exchange&nbsp;as the overseas trader. An OSBP is entitled to authorize Members to conduct clearing, delivery and pledge of warehouse receipts and other relevant business with the Exchange in accordance with relevant provisions. And an OSBP is entitled to accessing the trading facilities provided by the Exchange and obtaining the information and services related to futures trading.&nbsp;</span></p>\r\n<p class=&#34;p6&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;><br />\r\n</span></p>\r\n<p class=&#34;p5&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0); min-height: 16px;&#34;>&nbsp;</p>\r\n<p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>Elf&nbsp;Chen, the Deputy General Manager &amp; Head of Sales of Huatai (Hong Kong) Futures Limited said, &ldquo;As the first OSBP approved by the Exchange, Huatai (Hong Kong) Futures Limited can provide various high- quality services, involving DMA, multi- currency clearing services, and physical delivery services, to industrial corporations who are devoted to trading of specific futures products of Chinese market, including crude oil, copper (BC) and TSR20. We believe that, the internationalization of Chinese futures market becomes an essential motivation of the increasing oversea institutional corporations with great demand on risk management and arbitrage and experienced professional investors, to participate in Chinese commodity market directly. With strong connection with Huatai Futures, who provides best- in- class financial services in China market, Huatai (Hong Kong) Futures Limited. can now provide market- leading order execution and clearing solutions for investors.&rdquo;&nbsp;</span></p>\r\n<p class=&#34;p6&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;><br />\r\n</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>As shown by data released by the Exchange, until Oct 12, the accumulated trading volume of the crude oil futures reached 14,637,000 lots, calculated as one-side positions, with a turnover of 7,320,000,000,000 yuan. The average of daily trading volume reached 109,200 lots and the peak of daily trading volume reached 211,200 lots. The average of daily open interest reached 15,900 lots and the peak of daily open interest reached 25,000 lots. The average of daily turnover reached 54,609,000,000 yuan and the highest daily turnover reached 123,230,000,000 yuan. On the basis of &ldquo;international platform, net pricing, bonded delivery, and RMB denomination&rdquo;, the Exchange would engage in and promote the internationalization of Chinese futures market with steady steps.</span></p>', '', '', '', '', ''),
(1, 2, 'Huatai (Hong Kong) Futures Ltd. and Trading Technologies Partner to Provide Connectivity to Chinese Derivatives Markets via the TT® Platform', '<p class=&#34;p1&#34; style=&#34;margin: 0px 0px 12px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 24px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>Huatai (Hong Kong) Futures Ltd. and Trading Technologies Partner to Provide Connectivity to Chinese Derivatives Markets via the TT&reg; Platform</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px 0px 12px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>CHICAGO and HONG KONG, June 15, 2020 &mdash; Trading Technologies International, Inc. (TT), a global provider of high-performance professional trading software, infrastructure and data solutions, and Huatai (Hong Kong) Futures Ltd., the subsidiary of Huatai Futures Ltd. today announced they have contracted to provide connectivity to the Chinese international derivatives markets through the TT platform.</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px 0px 12px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>Through partnering with TT, Huatai&rsquo;s global customers will be able to trade Chinese international derivatives products listed on the China Financial Futures Exchange (CFFEX), Dalian Commodities Exchange (DCE), Shanghai Futures Exchange (SHFE), Shanghai International Energy Exchange (INE) and Zhengzhou Commodity Exchange (ZCE) via the TT platform.</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px 0px 12px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>Mark Pottle, Regional Executive Sales Director for Trading Technologies in Asia, said, &quot;We are thrilled to announce Huatai (Hong Kong) Futures Ltd. has chosen the TT platform as a solution to support international clients&rsquo; access to trade China. By partnering with Huatai (Hong Kong) Futures Ltd., we are immediately building on our commitment to provide a best-in-class experience for our customers.&rdquo;</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px 0px 12px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>Elf Chen, Deputy General Manager of Huatai (Hong Kong) Futures Limited, said, &ldquo;This partnership with Trading Technologies comes at a time when China is opening up its listed derivatives markets for global investors while overseas listed derivatives markets are getting more and more attention from Chinese investors. Together with TT, Huatai can now provide a one-stop solution for overseas and Chinese institutions at the highest global standard.&rdquo;</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px 0px 12px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;; -webkit-text-stroke-color: rgb(0, 0, 0);&#34;><span class=&#34;s1&#34; style=&#34;font-kerning: none;&#34;>TT&rsquo;s privately managed infrastructure spans five continents, delivering secure market access and superior performance from anywhere in the world. Designed specifically for professional traders, TT incorporates a broad array of customizable tools to accommodate trading strategies that range from manual point-and-click trading to single-digit microsecond automated order entry.</span></p>', '', '', '', '', ''),
(3, 2, '华泰香港期货及Trading Technologies旗下TT平台携手提供连接中国衍生品交易市场的桥梁', '<p>华泰（香港）期货有限公司（&ldquo;华泰香港期货&rdquo;）及Trading Technologies旗下TT平台携手提供连接中国衍生品交易市场的桥梁</p>\r\n<p>芝加哥及香港，2020年6月15日-全球高性能交易软件、基建、数据中心提供商Trading Technologies International, Inc. (TT)与华泰香港期货（华泰期货有限公司之子公司）近日携手宣布，双方已就通过TT平台进入中国及国际衍生品市场并提供连接服务达成合作伙伴协议。</p>\r\n<p>与TT的合作将为华泰香港期货的海外客户提供进入中国期货市场的机会。客户可使用TT交易系统交易中国金融期货交易所、大连商品交易所、上海期货交易所、上海国际能源交易中心及郑州商品交易所上市的期货产品。</p>\r\n<p>Trading Technologies亚洲地区区域销售行政总监Mark Pottle表示：&ldquo;我们欣然宣布，华泰香港期货选择TT作为合作伙伴，以协助国际客户进入中国市场。与华泰香港期货合作的同时，我司此志向客户提供最优质的体验。</p>\r\n<p>华泰香港期货副总经理陈伯龙表示：&ldquo;华泰香港期货与Trading Technologies的合作，正值中国投资者越发积极地参与全球衍生品市场而中国亦向全球投资者开放其衍生品市场的历史时期。和TT携手，华泰可为中国及海外机构客户提供达国际标准的一站式交易执行解决方案&rdquo;。</p>\r\n<p>TT的交易基建遍及五大洲，在全世界为各类客户提供安全而优秀的国际市场对接服务。作为为专业投资者量身定制的交易服务商，TT因应客户不同的交易策略的需要，提供广泛、可定制的交易工具，例如人工点选的下单服务及单数位微秒计自动下单功能。</p>', '', '', '', '', ''),
(2, 2, '华泰香港期货及Trading Technologies旗下TT平台携手提供连接中国衍生品交易市场的桥梁', '<p>华泰（香港）期货有限公司（&ldquo;华泰香港期货&rdquo;）及Trading Technologies旗下TT平台携手提供连接中国衍生品交易市场的桥梁</p>\r\n<p>芝加哥及香港，2020年6月15日-全球高性能交易软件、基建、数据中心提供商Trading Technologies International, Inc. (TT)与华泰香港期货（华泰期货有限公司之子公司）近日携手宣布，双方已就通过TT平台进入中国及国际衍生品市场并提供连接服务达成合作伙伴协议。</p>\r\n<p>与TT的合作将为华泰香港期货的海外客户提供进入中国期货市场的机会。客户可使用TT交易系统交易中国金融期货交易所、大连商品交易所、上海期货交易所、上海国际能源交易中心及郑州商品交易所上市的期货产品。</p>\r\n<p>Trading Technologies亚洲地区区域销售行政总监Mark Pottle表示：&ldquo;我们欣然宣布，华泰香港期货选择TT作为合作伙伴，以协助国际客户进入中国市场。与华泰香港期货合作的同时，我司此志向客户提供最优质的体验。</p>\r\n<p>华泰香港期货副总经理陈伯龙表示：&ldquo;华泰香港期货与Trading Technologies的合作，正值中国投资者越发积极地参与全球衍生品市场而中国亦向全球投资者开放其衍生品市场的历史时期。和TT携手，华泰可为中国及海外机构客户提供达国际标准的一站式交易执行解决方案&rdquo;。</p>\r\n<p>TT的交易基建遍及五大洲，在全世界为各类客户提供安全而优秀的国际市场对接服务。作为为专业投资者量身定制的交易服务商，TT因应客户不同的交易策略的需要，提供广泛、可定制的交易工具，例如人工点选的下单服务及单数位微秒计自动下单功能。</p>', '', '', '', '', ''),
(3, 6, '华泰（香港）期货有限公司喜获港交所最活跃经纪商-货币期货奖', '<p>华泰（香港）期货有限公司近日喜获港交所颁发最活跃经纪商-货币期货奖。在香港期货交易所的上百家会员中，华泰（香港）期货压众多交易所会员单位，斩获该奖项。 &nbsp;</p>\r\n<p>自2020年初成为港交所会员以来，华泰（香港）期货有限公司一直致力于推广港交所各类别期货产品，包括指数类产品及汇率类产品，尤其是在以美元兑人民币产品为首的汇率类产品的推广中取得瞩目成绩。汇率类产品是国际期货产品丰富的产品池中的重要一环，交易相关产品可帮助投资者在波动的汇率市场中把握投资机会并管理汇率风险。 &nbsp;</p>\r\n<p>此外，华泰（香港）期货有限公司一直配合港交所政策，积极发展其他产品的交易，如MSCI中国A50互联互通（美元）指数期货，并结合港交所全资子公司-伦敦金属交易所，努力发展LME基本金属的交易。 &nbsp;</p>\r\n<p>香港交易及结算所有限公司（香港交易所）是世界主要的交易所集团之一，业务范围包括股票、大宗商品、衍生产品、定息及货币产品。香港交易所是全球领先的新股融资中心，也是香港唯一的证券及衍生产品交易所和结算所营运机构，为国际投资者提供进入亚洲最活跃市场的渠道。香港交易所透过全资子公司伦敦金属交易所（LME）和LME Clear Limited，运营全球领先的工业金属交易市场。香港交易所是与中国内地市场互联互通的开拓者。2021年，香港交易所最近推出了首只以MSCI中国A50互联互通指数为标的期货合约，这个指数追踪了50只通过沪深港通交易的主要沪深股票的表现，来帮助沪深港通的投资者管理投资A股组合的风险。</p>\r\n<p>华泰（香港）期货为个人、机构客户提供24小时不间断的全球市场交易服务，以专业人才团队为依托，为客户创造优质的服务，致力于境内外业务互联互通模式探索。作为港交所会员，华泰（香港）期货一直保持和港交所的密切往来，积极推广港交所提供的各类衍生产品，致力于为客户交易港交所产品提供最优的交易执行和清算方案，打造中资在港期货服务机构的核心竞争优势。</p>', '', '', '', '', ''),
(1, 6, 'Huatai (Hong Kong) Futures Co., Ltd. recently won the Top Broker - Currency Futures award from the Hong Kong Exchanges and Clearing Limited', 'Huatai (Hong Kong) Futures Co., Ltd. recently won the Top Broker - Currency Futures award from the Hong Kong Exchanges and Clearing Limited (HKEX). Among the hundreds of members of HKEX, Huatai (Hong Kong) Futures won the award over many exchange members.\r\n\r\nSince becoming a member of the Hong Kong Stock Exchange in early 2020, the Company has been committed to promoting various futures products of the HKEX, including stock index products and FX products, especially in exchange rate products led by USD/RMB products. Remarkable achievements have been made in the promotion of such products. FX products are an important part of the product pool of global futures products. Trading FX products can help investors seize investment opportunities and manage currency exchange risks in the volatile exchange rate market.\r\n\r\nIn addition, Huatai (Hong Kong) Futures Co., Ltd. has been cooperating with the policies of the HKEX, actively developing the trading of futures products other than FX products, such as the MSCI China A50 Connect (USD) Index Futures. Moreover, the Company has been strived to develop base metals trading of LME, a wholly-owned subsidiary of HKEX.\r\n\r\nHong Kong Exchanges and Clearing Limited (HKEX) is one of the world’s major exchange groups, and operates a range of equity, commodity, fixed income and currency markets.  HKEX is the world’s leading IPO market and as Hong Kong’s only securities and derivatives exchange and sole operator of its clearing houses, it is uniquely placed to offer regional and international investors access to Asia’s most vibrant markets. HKEX is also the global leader in metals trading, through its wholly owned subsidiaries, The London Metal Exchange (LME) and LME Clear Limited. HKEX launched the pioneering Mainland -Hong Kong Stock Connect programs. In 2021, HKEX initially launched a futures contract based on the MSCI China A 50 Connect Index, which tracks the performance of 50 key Shanghai and Shenzhen stocks available via Stock Connect, to help investors of Shanghai & Shenzhen- Hong Kong Stock Connect programs to manage the risk of A share investment portfolios.  \r\n\r\nThe Company provides 24h services in dealing in futures contracts covering global markets for both individual and institutional clients. The Company aims to build its competitive advantages in futures dealing services and explores to establish a linkage mechanism between domestic and oversea market. High quality service is provided by our professional team. As a member of HKEX, the Company has always maintained close contacts with HKEX and actively promoted various derivatives products provided by HKEX, committed to providing clients with outstanding order execution and clearing solutions for trading products of HKEX, and building the core competitive advantage of Chinese-funded futures service institutions in Hong Kong. ', '', '', '', '', '');
