(1, 3, 'ATP交易系统', '<p>华泰香港期货ATP是一套可支持套利程序的交易软件，已于近日上线。ATP 交易系统附带手机交易平台，提供开放API 接口，助力程序化交易， 轻松连接全球期货及期权市场，成为您身边的内外盘套利专家。</p>\r\n<p>​特色：<br />\r\n​轻松对接全球期货及期权市场，实现便利的全球期货产品交易；<br />\r\n​实时显示账户资金、权益、成交、持仓信息，收益风险了如指掌；<br />\r\n​设定风险参数，掌握下单及持仓风险，满足您的风险管理需求；<br />\r\n​实时、多档报价，显示K 线图，可自定义合约组合及报价档位；<br />\r\n​支持多类单种，含有自动单功能，可设置止盈止损单、gainbest 单及策略单，通过设置相关参数，获取最大收益；<br />\r\n​自定义设置多种合约组合、多种套利策略，轻松实现跨市场、跨品种、跨期套利。</p>\r\n<p>ATP交易客户端，每月20USD的使用收费。如需ATP API授权，请联络您的销售人员或电邮至<a href=&#34;mailto:sales@htfc.com.h&#34;>sales@htfc.com.h</a>k。 手机交易软件下载（解压密码为39161616）：</p>', '', '', '', '', '', ''),
