(1, 4, 'TT交易系统', '<p>华泰香港期货ATP是一套可支持套利程序的交易软件，已于近日上线。ATP 交易系统附带手机交易平台，提供开放API 接口，助力程序化交易，轻松连接全球期货及期权市场，成为您身边的内外盘套利专家。</p>\r\n<p>​特色：<br />\r\n​轻松对接全球期货及期权市场，实现便利的全球期货产品交易；<br />\r\n​实时显示账户资金、权益、成交、持仓信息，收益风险了如指掌；<br />\r\n​设定风险参数，掌握下单及持仓风险，满足您的风险管理需求；<br />\r\n​实时、多档报价，显示K 线图，可自定义合约组合及报价档位；<br />\r\n​支持多类单种，含有自动单功能，可设置止盈止损单、gainbest 单及策略单，通过设置相关参数，获取最大收益；<br />\r\n​自定义设置多种合约组合、多种套利策略，轻松实现跨市场、跨品种、跨期套利。</p>\r\n<p>ATP交易客户端，每月20USD的使用收费。如需ATP API授权，请联络您的销售人员或电邮至<a href=&#34;mailto:sales@htfc.com.hk&#34;>sales@htfc.com.hk</a>。 手机交易软件下载（解压密码为39161616）：</p>', '', '', '', '', '', ''),
(3, 1, '个人客户网上开户', '<p>华泰（香港）期货有限公司现已上线网上开户系统。客户可扫描以下二维码进入网上开户页面。</p>\r\n<p>客户需登记手机号码以接收验证码登录网上开户系统。开户过程中客户可随时退出系统，亦可随时使用验证码重新登录网上开户系统。<strong>开户审核完成后，客户将邮件收到登入账号及交易密码，登录交易端即可进行期货及期权交易。</strong></p>\r\n<p>开户时客户需预先持有<strong>i). 香港银行账户; ii). 身份证明文件及住址证明文件（非内地居民/填写通讯地址与身份证地址不同时）</strong>方可开户。</p>\r\n<p>线上开户时需收听风险披露录音，并入金港币10,000元或等值外币，方可达到规管机构对网上开户的监管要求。</p>\r\n<p>&nbsp;</p>', '', '', '', '', '', ''),
(3, 2, '机构及个人线下开户', '<p>客户可选择亲临本公司现场开户，个人客户可扫描二维码进行网上开户。</p>\r\n<table class=&#34;raoc-tb&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th rowspan=&#34;3&#34; class=&#34;raoc-tb-row-01&#34;>&nbsp;</th>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>账户类型</td>\r\n        </tr>\r\n        <tr>\r\n            <td class=&#34;raoc-tb-row-02&#34;>个人账户</td>\r\n            <td class=&#34;raoc-tb-row-03&#34;>联名账户</td>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-04&#34;>机构账户</td>\r\n        </tr>\r\n        <tr>\r\n            <th rowspan=&#34;10&#34; class=&#34;raoc-tb-row-01&#34;>本公司提供，客户需下载并填写、签署</th>\r\n            <td colspan=&#34;2&#34;>N.A.</td>\r\n            <td colspan=&#34;2&#34;>授权成立账户公司决议案</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>账户开户表格连同客户协议书 &ndash; 条款及条</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>客户款项常设授权</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>实时市场数据条款</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>非美国人免扣除美国所得税声明书</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>委托授权书（如适用）</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>香港证监会持牌人雇主同意信（如适用）</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>申请邮寄结单服务（如适用）[1]</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>手续费申请单</td>\r\n        </tr>\r\n        <tr>\r\n            <td class=&#34;raoc-tb-row-05&#34;>CRS自我证明表格-个人</td>\r\n            <td class=&#34;raoc-tb-row-11&#34;>CRS自我证明表格-个人（第一及第二客户各填一份）</td>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-06&#34;>CRS自我证明表格-实体CRS自我证明表格-控权人</td>\r\n        </tr>\r\n        <tr>\r\n            <th rowspan=&#34;8&#34; class=&#34;raoc-tb-row-01&#34;>客户需自行准备</th>\r\n        </tr>\r\n        <tr>\r\n            <td rowspan=&#34;4&#34; colspan=&#34;2&#34; class=&#34;raoc-tb-row-07&#34;>N.A.</td>\r\n            <td colspan=&#34;2&#34;>公司成立证书[2]</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;2&#34;>公司组织章程</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;2&#34;>商业登记证[3]</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;2&#34;>公司年报表（AR1）[4]</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>银行证明文件（或后补银行证明文件确认书）</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-07&#34;>身份证明文件</td>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-08&#34;>与公司客户有关联人士、董事、&gt;25%股权之最终拥有人、或授权全权负责账户之个人、或授权发出指示下单交易之个人、或授权发出指示调动资金或结算之个人的身份证明文件</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-09&#34;>3个月内的住址证明[5]</td>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-10&#34;>&gt;25%股权之最终拥有人的3个月内的住址证明[6]</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>香港公司开户还需准备实益拥有人的登记册</p>\r\n<ul class=&#34;raocn-list&#34;>\r\n    <li>[1] 收费项目，每份结单收费港币50元，只提供月结单</li>\r\n    <li>[2] 香港以外的公司（&ldquo;海外公司&rdquo;）请提供6个月内发出之董事在职证明书Certificate of Incumbency</li>\r\n    <li>[3] 最近有效期内的商业登记证</li>\r\n    <li>[4] 最近一年的公司年报表及往后之递交公司注册处之补充表格</li>\r\n    <li>[5] 住址证明文件包括：公用事务账单、政府部门发出之文件、由认可机构、持牌法团或获授权保险人发出的结单、流动电话或收费电视结单 (寄往客户所提供的地址)；及，列有国内住址的有效的国内身份证</li>\r\n    <li>[6] 同上</li>\r\n</ul>', '', '', '', '', '', ''),
(1, 2, 'Account Opening Counter Services', '<p>Counter Services are provided for corporate and individual account opening. For individual account opening, please use the online account opening system.&nbsp;</p>\r\n<table class=&#34;raoc-tb&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th rowspan=&#34;3&#34; class=&#34;raoc-tb-row-01&#34;>&nbsp;</th>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>Account Categories</td>\r\n        </tr>\r\n        <tr>\r\n            <td class=&#34;raoc-tb-row-02&#34;>Individual Account</td>\r\n            <td class=&#34;raoc-tb-row-03&#34;>Joint Account</td>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-04&#34;>Corporate Account</td>\r\n        </tr>\r\n        <tr>\r\n            <th rowspan=&#34;10&#34; class=&#34;raoc-tb-row-01&#34;>Forms&nbsp; Provided by Huatai, to be Filled In by Client</th>\r\n            <td colspan=&#34;2&#34;>N.A.</td>\r\n            <td colspan=&#34;2&#34;>Company Resolution to Setup Account</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>A/C Opening Form &amp; Client Agreement - Terms and Conditions</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>Standing Authority</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>Market Data Terms and Conditions</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>W8BEN-E Form</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>Authorization Request (if applicable)</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>Employer Consent Letter for Licensed Persons of HKSFC (if applicable)</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>Request to receive statement by Mail (if applicable)[1]</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>Commission Rate Application Form</td>\r\n        </tr>\r\n        <tr>\r\n            <td class=&#34;raoc-tb-row-05&#34;>Self Certification</td>\r\n            <td class=&#34;raoc-tb-row-11&#34;>Self Certification Form-Individuals, to be Submitted Seperately</td>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-06&#34;>Self-Certification Form Entity<br />\r\n            Self-Certification Form- Controlling Person</td>\r\n        </tr>\r\n        <tr>\r\n            <th rowspan=&#34;8&#34; class=&#34;raoc-tb-row-01&#34;>To be Prepared by Clients</th>\r\n        </tr>\r\n        <tr>\r\n            <td rowspan=&#34;4&#34; colspan=&#34;2&#34; class=&#34;raoc-tb-row-07&#34;>N.A.</td>\r\n            <td colspan=&#34;2&#34;>Certificate of Incorporation[2]</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;2&#34;>Memorandum and Articles of Association</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;2&#34;>Business Registration[3]</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;2&#34;>Annual Return (AR1)[4]</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34;>Bank Account Proof</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-07&#34;>Identification Documents</td>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-08&#34;>Identification Documents of Associated Persons, Directors, Beneficial Owners with &gt;25% Shares, Authorized Persons Responsible for Account Management, Authorized Traders, Authorized Persons for Fund In/Out or Settlement</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-09&#34;>Address Proof Issued Within 3 Months[5]</td>\r\n            <td colspan=&#34;2&#34; class=&#34;raoc-tb-row-10&#34;>Address Proof Issued Within 3 Months of Beneficial Owners with &gt;25% Shares[6]</td>\r\n        </tr>\r\n    </tbody>\r\n</table>', '', '', '', '', '', ''),
(1, 1, 'Account Opening for Individual Clients', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Huatai (Hong Kong) Futures Co., Ltd. has now launched its online account opening system. Clients can scan the following QR code to enter the online account opening page.</p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;>Clients need to register their mobile phone number to receive the verification code to log in to the online account opening system. During the account opening process, clients can leave the system at any time, and log in again to the online account opening system by obtaining the verification code. After the account opening application is approved and KYC verification is completed, the client will receive the account no. and<span class=&#34;Apple-converted-space&#34;>&nbsp; </span>trading password by email, and then log in to the trading system to start<span class=&#34;Apple-converted-space&#34;>&nbsp; </span>futures and options trading.</p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;>When opening an account, client need to hold i). A Hong Kong bank account; ii). Identification Documents and address proof documents (for non-Mainland residents, when the mailing address is different from the ID address) before the account can be opened.</p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;>When opening an online account, client need to listen to the risk disclosure recording, and deposit HK$10,000 or its equivalent in foreign currency to meet the regulatory requirements for online account opening.</p>', '', '', '', '', '', ''),
(1, 5, 'DCE & ZCE', '<p>Please check the Supplementary Agreement on Participation in Trading Futures and/ or Options of Specific Types in China.</p>', '', '', '', '<p>To be updated.</p>', '', 'Shanghai Futures Exchange & Shanghai International Energy Exchange'),
(3, 5, '大商所和郑商所', '<p>请查阅附加开户文件。</p>', '', '', '', '<p>敬请期待&nbsp;</p>', '', '上海期货交易所及能源中心'),
(2, 5, '大商所和郑商所', '<p>&nbsp;请查阅附加开户文件。</p>', '', '', '', '<p>敬请期待</p>\r\n<p>&nbsp;</p>', '', '上海期货交易所及能源中心');
