(1, 167, 'Crude Palm Oil', '', '', '', '', '1', '', '(a) When the 10% Limit is triggered (except for the current month),\r\n the Exchange will announce a 10-minute cooling off period\r\n (“the Cooling Off Period”) for Contracts of all contract months (except the current delivery month) during which trading may only take place within the 10% Limit\r\n (b) Following the Cooling Off Period, Contracts of all Contract months will be specified as reserved for a period of 5 minutes, after which the price limit will be expanded to 15%. The prices traded for Contracts of all Contract months (except the current month) must then not vary more than 15% above or below the settlement prices of the preceding Business Day  (“the 15% Limit”)\r\n (c) If the 10% Limit is triggered less than 30 minutes before the end of the first trading session, the 10% Limit will apply to Contracts of all Contract months (except the current month) for the rest of the first trading session  and the 15% Limit will apply to Contracts of all Contract months (except the current month) during the second trading session\r\n (d) If the 10% Limit is triggered less than 30 minutes before the end of the second trading session, the 10% Limit will apply to Contracts of all Contract months (except the current month) for the rest of the Business Day\r\n2. For the purposes of paragraph 1(a), the 10% Limit will be considered triggered in the manner as may be prescribed by the Exchange ', '10:30-12:30, 15:00-18:00，\r\nMon to Thu 21:00-23:30 ', 'Spot month and the next 11 succeeding months, and thereafter, alternate months up to 36 months ahead', 'Deliverable', '25ton', 'MYR', '25.00 '),
