INSERT INTO `tb_huatai_trading_market_desc` (`language_id`, `trading_market_id`, `name`, `detail`, `url`, `seo_desc`, `seo_title`, `detail2`, `seo_h1`, `other_name1`, `other_name2`, `other_name3`, `other_name4`, `other_name5`, `other_name6`, `other_detail1`, `other_detail2`, `other_detail3`, `other_detail4`, `other_detail5`, `other_detail6`, `name2`, `other2_name`, `other2_name2`, `other2_detail`, `other3_name`, `other3_name2`, `other3_name3`, `other3_name4`, `other3_name5`, `other3_name6`, `other3_name7`, `other3_name8`, `other3_detail`, `name3`) VALUES
(1, 1, 'Dalian Commodity Exchange', '<p class=&#34;p1&#34; times=&#34; new=&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; margin: 0px; text-align: justify;&#34;>Founded in 1993, the Dalian Commodity Exchange (DCE) is a futures exchange approved by the State Council and regulated by China Securities Regulatory Commission (CSRC).A total of 21 futures and 7 options have been listed for trading on DCE, which include corn, corn starch, polished round-grained rice, No.1 soybean, No.2 Soybean, soybean meal, soybean oil, RBD palm olein, egg, hogs, fiberboard, blockboard, linear low density polyethylene (LLDPE), polyvinyl chloride (PVC), polypropylene (PP), ethylene glycol (EG),  ethenylbenzene (EB), metallurgical coke, coking coal, iron ore, LPG futures and soybean meal, corn, iron ore, LPG, polypropylene (PP), polyvinyl chloride (PVC) and linear low density polyethylene (LLDPE) options.&nbsp;&nbsp;In 2019, DCE&rsquo;s annual futures trading volume reached 1331 million lots and its turnover totaled RMB 68.92 trillion. And DCE&rsquo;s annual options trading volume reached 24,933,300 lots and RMB9,860,000,000. According to Futures Industry Association (FIA), DCE was the 11th largest exchange in the world by trading volume in 2019.</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>&nbsp;</p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;>In addition, DCE has introduced overseas traders into the iron ore futures market to open account, trade, deliver, and settle and formed a diversified and internationalized mode for derivatives market.<span class=&#34;Apple-converted-space&#34;>&nbsp;</span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;>&nbsp;</p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;>Huatai (Hong Kong) Futures Co., Ltd. is an Overseas Intermediary approved by DCE with the code of 8049. Huatai (Hong Kong) Futures Co., Ltd also serves as a subsidiary of Huatai Futures, China&#39;s leading comprehensive service platform for financial derivatives. Therefore, Huatai (Hong Kong) Futures Co. can act as an agent of Huatai Futures, processing overseas clients&rsquo; account opening applications to trade DCE products and can rely on Huatai Futures&#39; abundant industry resources and delivery experience to entrust Huatai Futures for settlement and bonded delivery.<span class=&#34;Apple-converted-space&#34;>&nbsp;</span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Contract Spec</p>\r\n<table id=&#34;normal_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <td width=&#34;120&#34;>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Product</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Iron Ore</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Trading Unit</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>100 MT/Lot</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Price Quote Unit</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>CNY/MT</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Minimum Tick Size</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>0.5&nbsp;CNY/MT</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Daily Price Limit Range*</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>4% of last settlement price</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Contract Months</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Jan, Feb, Mar, Apr, May, Jun, Jul, Aug, Sep, Oct, Nov, Dec</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Trading Hours</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>9:00 - 11:30 a.m., 1:30 - 3:00 p.m., Beijing Time, Monday to Friday, and other trading hours announced by DCE</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Last Trading Day</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>The 10th trading day of the contract month</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Last Delivery Day</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>The 3rd trading day after the last trading day</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Deliverable Grades</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Iron Ore Delivery Quality Standard of DCE(F/DCE I001-2019), the deliverable brands and the brand discounts and/or premiums will be separately prescribed by DCE.</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Delivery Point</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>The delivery warehouses and delivery locations of iron ore designated by DCE</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Minimum Trading Margin*</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>5% of the contract value</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Delivery Form</p>\r\n            </td>\r\n            <td>\r\n            <p class=&#34;p1&#34; style=&#34;margin: 7.5px 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; color:=&#34;&gt;&lt;span class=&#34;>Physical delivery</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Note 1: DCE may adjust the daily price limit ranges and the trading margins of each contract according to market conditions. For details of current trading parameters of each contract, please see below website:</p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;>www.dce.com.cn/DCE/TradingClearing/Business%20Parameters/Trading%20Parameters/index.html</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Note 2: Daytime Trading Hours are divided into three sections, namely 9:00-10:15, 10:30-11:30 and 13:30-15:00.</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Note 3: Nightime Trading Hours are 21:00-23:00.&nbsp;</p>\r\n<p>Reference：<a href=&#34;http://www.dce.com.cn/dalianshangpin/sspz/487477/487481/1500303/index.html&#34; target=&#34;_blank&#34;>http://www.dce.com.cn/dalianshangpin/sspz/487477/487481/1500303/index.html</a><br />\r\n<a href=&#34;http://www.dce.com.cn/dalianshangpin/resource/cms/2018/04/2018040920195474301.pdf&#34; target=&#34;_blank&#34;> http://www.dce.com.cn/dalianshangpin/resource/cms/2018/04/2018040920195474301.pdf </a></p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Account Opening Instruction', '', '<p class=&#34;p1&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal;&#34;>Documents Needed for Account Opening</p>\r\n<table cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; class=&#34;t1&#34; style=&#34;width: 830px; border-collapse: collapse;&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <td colspan=&#34;4&#34; valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: center; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Individual Clients</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p3&#34; style=&#34;margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; min-height: 14px;&#34;>&nbsp;</p>\r\n            </td>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Foreign Individual Clients</p>\r\n            </td>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Hong Kong&amp; Macau Individual Clients</p>\r\n            </td>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Taiwan Individual Clients</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Identification Documents for Reference</p>\r\n            </td>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Driving License, Social Insurance Certificates,&nbsp; Tax Payment Certificates, Original IDs, or Other Certificates to Refer</p>\r\n            </td>\r\n            <td colspan=&#34;2&#34; valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Driving License, Social Insurance Certificates,&nbsp; Mainland Travel Permit for Hong Kong and Macau Residents, Resident Permit of Hong Kong, Macau and Taiwan Residents, Taiwan ID Cards, or Other Certificates to Refer</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34; valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: center; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Corporate Clients</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Valid&nbsp;<span style=&#34;text-align: left;&#34;>Identification Documents</span></p>\r\n            </td>\r\n            <td colspan=&#34;3&#34; valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Certificates of Incorporation</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Identification Documents for Reference</p>\r\n            </td>\r\n            <td colspan=&#34;3&#34; valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Tax Payment Certificates issued by the Authority of the Country/ Region of Registration.&nbsp;</p>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>(If the client cannot provide Tax Payment Certificates, the client should provide relevant documentary proof or the Chinese translation of the documentary proof, applicable to companies incorporated in tax- exempted countries/ regions.)</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Other documents</p>\r\n            </td>\r\n            <td colspan=&#34;3&#34; valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Authorization Letter of the Insititutional Clients, IDs of the Executive Directors (or chairman of the BOD, CEO or other authorized representatives who has the capacity to represent the corporate client according to law and the Articles) or Legal Representatives and IDs of the Contact Person Authorized for Account Opening. For the market maker, the Market Making Agreement between the market maker and the Exchanges are to be provided.&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=&#34;4&#34; valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: center; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Clients with the Status of Financial Product</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Valid&nbsp;<span style=&#34;text-align: left;&#34;>Identification Documents</span></p>\r\n            </td>\r\n            <td colspan=&#34;3&#34; valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Contract of the Financial Product</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Identification Documents for Reference</p>\r\n            </td>\r\n            <td colspan=&#34;3&#34; valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Tax Payment Certificates&nbsp;<span style=&#34;text-align: left;&#34;>(if the client cannot provide Tax Payment Certificates, the client should provide relevant documentary proof or the Chinese translation of the documentary proof, applicable to companies incorporated in tax- exempted countries/ regions.)</span>, Certificate of Recording of the Regulatory Authorities Abroad, Instruction of the Financial Product, Specification of the Custodian, etc.</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Other documents</p>\r\n            </td>\r\n            <td colspan=&#34;3&#34; valign=&#34;middle&#34; class=&#34;td1&#34; style=&#34;padding: 0px 5px; border-style: solid; border-color: rgb(203, 203, 203);&#34;>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Authorization Letter of the Insititutional Clients, IDs of the Executive Directors (or chairman of the BOD, CEO or other authorized representatives who has the capacity to represent the corporate client according to law and the Articles) or Legal Representatives and IDs of the Contact Person Authorized for Account Opening. For the market maker, the Market Making Agreement between the market maker and the Exchanges are to be provided.&nbsp;</p>\r\n            <p class=&#34;p4&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&#34;>Custodian&#39;s Certificate of Incorporation and Tax Payment Certificates. Please refer to the required documents to be provided by corporate clients.&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p class=&#34;p3&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: Helvetica; margin: 0px; min-height: 14px;&#34;>&nbsp;</p>', 'Account Opening Procedure', 'Client Opens a Global Futures Account First', 'Client Deposits Funds According to the Exchange Requirement', 'Client Signs and Submits Relevant Documents According to the Exchange Requirement, Please Refer to Account Opening Guidelines', 'Client Receives Account No., Account Information, and Log- in Details by Email', 'Account Opening Completed', '', '', '', ''),
(1, 7, 'SGX', '<p>&nbsp;</p>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>&nbsp;</th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>FTSE China A50 Index</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Nikkei 225 Index</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>USD/CNH FX</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>TSI Iron Ore CFR China (62% Fe Fines) Index</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>Code</td>\r\n            <td>CN</td>\r\n            <td>NK</td>\r\n            <td>UC</td>\r\n            <td>FE</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Contract Size</td>\r\n            <td>1USD* Index</td>\r\n            <td>500JPY* Index</td>\r\n            <td>100,000USD</td>\r\n            <td>100 Tonnes</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Tick Size</td>\r\n            <td>1</td>\r\n            <td>5</td>\r\n            <td>0.0001</td>\r\n            <td>0.01</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Price Fluctuation</td>\r\n            <td>1USD</td>\r\n            <td>2500JPY</td>\r\n            <td>10CNH</td>\r\n            <td>1USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Currency</td>\r\n            <td>USD</td>\r\n            <td>JPY</td>\r\n            <td>CNH</td>\r\n            <td>USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Trading Hours</td>\r\n            <td>09:00-16:35,17:00-05:15*</td>\r\n            <td>07:30-14:30,14:55-05:15*</td>\r\n            <td>07:25-18:00,18:15-05:15*</td>\r\n            <td>08:00-20:00,20:15-05:15*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Listed Months</td>\r\n            <td>\r\n            <p>The Upcoming 2 Months and 4 Calendar Quarter Months</p>\r\n            </td>\r\n            <td>3,6,9,12</td>\r\n            <td>\r\n            <p>13 Consecutive Months and the Following 8 Calendar Quarter Months</p>\r\n            </td>\r\n            <td>The Upcoming 48 Months</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Settlement Methods</td>\r\n            <td colspan=&#34;4&#34;>Deliverable<br />\r\n            &nbsp;</td>\r\n        </tr>\r\n    </tbody>\r\n</table>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `tb_huatai_trading_market_desc` (`language_id`, `trading_market_id`, `name`, `detail`, `url`, `seo_desc`, `seo_title`, `detail2`, `seo_h1`, `other_name1`, `other_name2`, `other_name3`, `other_name4`, `other_name5`, `other_name6`, `other_detail1`, `other_detail2`, `other_detail3`, `other_detail4`, `other_detail5`, `other_detail6`, `name2`, `other2_name`, `other2_name2`, `other2_detail`, `other3_name`, `other3_name2`, `other3_name3`, `other3_name4`, `other3_name5`, `other3_name6`, `other3_name7`, `other3_name8`, `other3_detail`, `name3`) VALUES
(3, 6, '香港交易所', '<p>指数类产品</p>\r\n<p>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>&nbsp;</th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>恒⽣指数</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>H股指数</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>⼩型恒⽣指数</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>⼩型H股指数</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>编号</td>\r\n            <td>HSI</td>\r\n            <td>HHI</td>\r\n            <td>MHI</td>\r\n            <td>MCH</td>\r\n        </tr>\r\n        <tr>\r\n            <td>合约乘数</td>\r\n            <td>50港元*指数</td>\r\n            <td>50港元*指数</td>\r\n            <td>10港元*指数</td>\r\n            <td>10港元*指数</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最⼩变动价位</td>\r\n            <td>1</td>\r\n            <td>1</td>\r\n            <td>1</td>\r\n            <td>1</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最⼩变动价位值</td>\r\n            <td>50HKD</td>\r\n            <td>50HKD</td>\r\n            <td>10HKD</td>\r\n            <td>10HKD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算币种</td>\r\n            <td colspan=&#34;4&#34;>HKD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易时间</td>\r\n            <td colspan=&#34;4&#34;>09:15-12:00,13:00-16:30, 17:15-03:00*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易⽉份</td>\r\n            <td colspan=&#34;4&#34;>现⽉、下⽉及之后两个季⽉</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算⽅式</td>\r\n            <td colspan=&#34;4&#34;>现⾦</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<ul>\r\n    <li>成熟的资本市场及具有广泛代表性的合约标的：</li>\r\n</ul>\r\n<p>无论经验丰富还是初入市场的投资者，均可透过购买恒生指数及H股指数期货及期权合约，就指数成分股进行投资。由于本地投资者及国际投资者均视恒生指数及H股指数作为量度香港股市及投资组合指数的指标，因此投资者一直沿用恒生指数、H股指数期货及期权合约作买卖及风险管理。</p>\r\n<ul>\r\n    <li>高杠杆买卖：</li>\r\n</ul>\r\n<p>保证金金额通常只占合约价值的小部分，这种具有低保证金高杠杆的特性，令买卖及对冲活动更具资本效益。</p>\r\n<ul>\r\n    <li>资产配置效益高：</li>\r\n</ul>\r\n<p>股指期货交易成本低，可作为资产配置的手段。股市上涨时，可用较低的成本买入股指期货，以获得股市上涨的平均收益。股市下跌时，可做空以对冲股市整体下跌的系统性风险。</p>\r\n<ul>\r\n    <li>价格发现功能：</li>\r\n</ul>\r\n<p>股指期货参与者众多，通过在公开、高效的期货市场中众多投资者的竞价，有利于形成更能反映股票真实价值的股票价格。低廉的交易成本使得股指期货价格对市场信息的反应更快。</p>\r\n<div>&nbsp;</div>\r\n<div><br />\r\n<table id=&#34;normal_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <td width=&#34;120&#34;>相关指数</td>\r\n            <td>MSCI 中国 A50 互联互通指数</td>\r\n        </tr>\r\n        <tr>\r\n            <td>HKATS代码</td>\r\n            <td>MCA</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易货币</td>\r\n            <td>美元</td>\r\n        </tr>\r\n        <tr>\r\n            <td>相关指数货币</td>\r\n            <td>离岸人民币</td>\r\n        </tr>\r\n        <tr>\r\n            <td>合约乘数</td>\r\n            <td>25 美元</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最低价格波幅</td>\r\n            <td>0.2&nbsp;指数点</td>\r\n        </tr>\r\n        <tr>\r\n            <td>合约月份</td>\r\n            <td>现月、下月及之后的四个季月</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最后交易日</td>\r\n            <td>合约月份的第三个星期五。如该日并非为香港营业日，或该日为中国假期， 则为前一个香港营业日而该日亦是中国营业日。</td>\r\n        </tr>\r\n        <tr>\r\n            <td>开市前议价时段</td>\r\n            <td>上午8时45分至上午9时正</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易时间</td>\r\n            <td>上午9时正至下午4时30分（日间交易时段）<br />\r\n            下午5时15分至凌晨3时正（收市后交易时段）<br />\r\n            最后交易日的交易时段为上午9时正至下午3时正</td>   \r\n        </tr>\r\n        <tr>\r\n            <td>最后结算价</td>\r\n            <td>在最后交易日当天下列时间所报MSCI中国A50互联互通指数点的平均数为依归：（i）在上海交易所和深圳交易所持续交易时段结束前的最后两小时，每隔15秒的指数点，与（ii）收市指数点，如第三个小数位的数字为5或大于5，则四舍五入上调至最接近的两个小数位，如第三个小数位的数字小于5，则四舍五入下调至最接近的两个小数位。</td>\r\n        </tr>\r\n  