;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>产品名</th>\r\n            <th width=&#34;90&#34;>标的</th>\r\n            <th width=&#34;90&#34;>市场覆盖</th>\r\n        </tr>\r\n        <tr>\r\n            <td>MSCI新兴市场（美元）指数期货</td>\r\n            <td>追踪26个新兴市场（阿根廷、巴西、智利、中国内地、哥伦比亚、捷克共和国、埃及、希腊、匈牙利、印度、印尼、韩国、马来西亚、墨西哥、巴基斯坦、秘鲁、菲律宾、波兰、卡塔尔、俄罗斯、沙地阿拉伯、南非、台湾、泰国、土耳其和阿拉伯联合酋长国）内的大型市值及中型市值股票表现</td>\r\n            <td>1,385只成份股复盖各市场约85％的流通市值</td>\r\n        </tr>\r\n        <tr>\r\n            <td>MSCI新兴市场净总回报(美元)指数</td>\r\n            <td>追踪26个新兴市场（阿根廷、巴西、智利、中国内地、哥伦比亚、捷克共和国、埃及、希腊、匈牙利、印度、印尼、韩国、马来西亚、墨西哥、巴基斯坦、秘鲁、菲律宾、波兰、卡塔尔、俄罗斯、沙地阿拉伯、南非、台湾、泰国、土耳其和阿拉伯联合酋长国）内的大型市值及中型市值股票表现</td>\r\n            <td>1,385只成份股复盖各市场约85％的流通市值</td>\r\n        </tr>\r\n        <tr>\r\n            <td>MSCI香港净总回报(美元)指数</td>\r\n            <td>追踪香港股票市场内大型市值及中型市值股票表现的成熟指标</td>\r\n            <td>涵盖40只成份股并复盖香港股票市场约85％的流通市值</td>\r\n        </tr>\r\n        <tr>\r\n            <td>MSCI印尼(美元)指数</td>\r\n            <td>追踪印尼股票市场内大型市值及中型市值股票表现的成熟指标</td>\r\n            <td>涵盖22只成份股并复盖印尼股票市场约85％的流通市值</td>\r\n        </tr>\r\n        <tr>\r\n            <td>MSCI菲律宾净总回报(美元)指数</td>\r\n            <td>追踪菲律宾股票市场内大型市值及中型市值股票表现的成熟指标</td>\r\n            <td>涵盖21只成份股并复盖菲律宾股票市场约85％的流通市值</td>\r\n        </tr>\r\n        <tr>\r\n            <td>MSCI新加坡净总回报(美元)指数</td>\r\n            <td>追踪新加坡股票市场内大型市值及中型市值股票表现的成熟指标</td>\r\n            <td>涵盖22只成份股并复盖新加坡股票市场约85％的流通市值</td>\r\n        </tr>\r\n        <tr>\r\n            <td>MSCI越南净总回报(美元)指数</td>\r\n            <td>追踪越南股票市场内大型市值及中型市值股票表现的成熟指标</td>\r\n            <td>涵盖17只成份股并复盖印尼股票市场约85％的流通市值</td>\r\n        </tr>\r\n        <tr>\r\n        </tr>\r\n        <tr>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p>MSCI介绍</p>\r\n<p>MSCI 所编的指数涵盖全球，主要以国家、地区、市场、产业等进行编纂。以国家像是日本指数、韩国指数，也有以地区分的欧元区指数，以产业分的能源指数等等。 MSCI 会依据其标准挑选成分股，以 MSCI 指数所组成的股票来说，通常是各个国家的代表性个股、产业龙头股居多，因此被纳入的公司，也通常会是稳健获利、有竞争力的大型绩优股。MSCI编制的指数，和富时类指数类似，在市场上有极高的认可度。</p>\r\n<p>指数编制公司把指数编制出来，投资利用指数来检测全球资本市场的行情；例如说，A股的上证50涨了，投资者可预计市场蓝筹股的增长。极具代表性的指数可以反映市场的基本运行状况。</p>\r\n<p>MSCI发展历程</p>\r\n<p>1968年，资本国际（Capital International）发布涵盖非美国市场的全球股票市场指数。1986年，Morgan Stanley从资本国际取得指数的授权，并将该指数作为摩根士丹利资本国际（MSCI）指数。到20世纪80年代，在富時集團、花旗银行和标准普尔加入前，MSCI指数是美国以外的主要基准指数。在道琼斯公司开始浮动加权其指数基金后，MSCI随即跟进。2004年，MSCI收购Barra公司，形成MSCI Barra。2007年中，母公司Morgan Stanley决定从MSCI撤资，并可能分拆MSCI。撤资于2009年完成。</p>\r\n<p>MSCI扩容</p>\r\n<p>A股纳入MSCI指数，经过了数次的努力。2019年6月，A股被纳入MSCI新兴市场指数一 事将正式生效，共有234家A股大盘股公司入围。6月1日进入首次纳入适应期，纳入比例2.5%，对应MSCI新兴市场指数市值权重0.37%。9月3日完成首次纳入，纳入比例5%，对应权重为0.73%。</p>\r\n<p>在2019年8月，MSCI也宣布实施第二轮扩容计划，将新兴市场指数中中国大盘A股纳入因子由10%增至15%，这次调整增加8只A股，2只香港上市中资股，大盘A股纳入因子将从10%增加至15%。 调整后，中国A股在MSCI中国指数和MSCI新兴市场指数中的权重分别为7.79%和2.46%。&nbsp;</p>\r\n<p>此后，MSCI 会把指数中的所有中国大盘 A 股纳入因子从 15％增加至 20％，同时将中国中盘 A 股（包括符合条件的创业板股票）以 20％的纳入因子纳入 MSCI 指数。</p>\r\n<p>随着中国A股市场准入机制的不断改善，市场的深入开放不断发展，A股在MSCI的不断扩容预示国际市场机构投资者的实际需求。这将逐步提升中国股市的外资参与度；同时，外资的流入将为中国实体经济向以科技、服务及消费驱动的升级转型提供支持。</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
