5USD</td>\r\n            <td>6.25USD</td>\r\n            <td>10USD</td>\r\n            <td>12.5USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算币种</td>\r\n            <td colspan=&#34;7&#34;>USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易时间</td>\r\n            <td colspan=&#34;7&#34;>06:00-05:00*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易⽉份</td>\r\n            <td colspan=&#34;7&#34;>3,6,9,12</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算⽅式</td>\r\n            <td colspan=&#34;7&#34;>实物</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</div>', '', '', '', '<p>能源类</p>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34; style=&#34;width: 815px;&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>&nbsp;</th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>美原油</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>小型美原油</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>布伦特原油最后结算</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>天然气</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>小型天然气</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>编号</td>\r\n            <td>CL</td>\r\n            <td>QM</td>\r\n            <td>BZ</td>\r\n            <td>NG</td>\r\n            <td>QG</td>\r\n        </tr>\r\n        <tr>\r\n            <td>合约乘数</td>\r\n            <td>1000桶</td>\r\n            <td>500桶</td>\r\n            <td>1000桶</td>\r\n            <td>10,000mmBtu</td>\r\n            <td>2,500mmBtu</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最⼩变动价位</td>\r\n            <td>0.01</td>\r\n            <td>0.025</td>\r\n            <td>0.01</td>\r\n            <td>0.001</td>\r\n            <td>0.005</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最⼩变动价位值</td>\r\n            <td>10USD</td>\r\n            <td>12.5USD</td>\r\n            <td>10USD</td>\r\n            <td>10USD</td>\r\n            <td>12.5USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算币种</td>\r\n            <td colspan=&#34;5&#34;>USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易时间</td>\r\n            <td colspan=&#34;5&#34;>06:00-05:00*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易⽉份</td>\r\n            <td>最近72个月</td>\r\n            <td>最近61个月</td>\r\n            <td>今年剩下月份及即将到来的7年</td>\r\n            <td>最近144个月</td>\r\n            <td>今年剩下月份及即将到来的3年</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算⽅式</td>\r\n            <td>实物</td>\r\n            <td>现金</td>\r\n            <td>现金</td>\r\n            <td>实物</td>\r\n            <td>现金</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>参与原油期货买卖的优点：</p>\r\n<ul>\r\n    <li>低买卖差价：经多年发展，原油期货市场聚集了各类投资者，市场交投量十分活跃，原油期货的买卖差价较低。以美原油CL2020年6月合约为例，仅4月15日收盘时，当日未平仓合约已达498,152手，十分具有流动性。</li>\r\n    <li>高杠杆买卖：与其它类型的产品（例如某银行的连续性原油产品合约）相比，国际原油类期货产品交易的保证金金额只占合约价值的一小部分，这种具有低保证金高杠杆的特性，令买卖及对冲活动更具资本效益。</li>\r\n    <li>弹性交易时段：以美原油CL合约为例，交易时间由早晨6点起交易到次日5点，国际原油期货交易时段接近24小时。作为国内原油期货交易的补充，国际原油期货市场弹性的交易时段可令投资者的投资及交易更加方便灵活。</li>\r\n    <li>高效率及透明度：稳健的电子交易及结算系统，让客户掌握市场上的即时变动。</li>\r\n</ul>\r\n<p>参与天然气及小型天然气期货买卖的优点：</p>\r\n<ul>\r\n    <li>亨利港（Henry Hub）天然气具备全球定价基准地位：亨利港作为美国一大天然气存储及交货地点，其价格被视为所有美国天然气定价的基准。美国天然气出口不断扩大至欧洲、亚洲，该产品正在为全球范围内的天然气制定价格。</li>\r\n    <li>成交量大，流动性高：芝商所的亨利港天然气期货是全球按交易量计第三大的实物大宗商品期货，在非美国交易时段，亨利港天然气期货17年上半年的成交量较去年同期相比增长了31%。</li>\r\n    <li>标的物产量大，需求高，具发展前景：随着天然气价格持续徘徊在近10年低位，叠加全球主要经济体对于清洁能源的诉求，天然气能源替代煤炭消费具有明显的效应优势。而包括页岩气等技术的进步，天然气供应前景较好，从而为以中国为代表的经济体完成工业化向服务型、技术性经济转型之际的环保治理提供了额外的清洁能源基础。天然气能源发展趋势良好。</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>金属类</p>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34; style=&#34;width: 815px;&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>&nbsp;</th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>美黄金</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>美白银</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>美铜</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>小型美黄金</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>小型美白银</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>编号</td>\r\n            <td>GC</td>\r\n            <td>SI</td>\r\n            <td>HG</td>\r\n            <td>QO</td>\r\n            <td>QI</td>\r\n        </tr>\r\n        <tr>\r\n            <td>合约乘数</td>\r\n            <td>100金衡制盎司</td>\r\n            <td>5,000金衡制盎司</td>\r\n            <td>25,000磅</td>\r\n            <td>50金衡制盎司</td>\r\n            <td>2,500金衡制盎司</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最⼩变动价位</td>\r\n            <td>0.01</td>\r\n            <td>0.005</td>\r\n            <td>0.0005</td>\r\n            <td>0.25</td>\r\n            <td>0.0125</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最⼩变动价位值</td>\r\n            <td>10USD</td>\r\n            <td>25USD</td>\r\n            <td>12.5USD</td>\r\n            <td>12.5USD</td>\r\n            <td>31.25USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算币种</td>\r\n            <td colspan=&#34;5&#34;>USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易时间</td>\r\n            <td colspan=&#34;5&#34;>06:00-05:00*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易⽉份</td>\r\n            <td>近月连续3个月+双数月份 2,4,6,8,10,12</td>\r\n            <td>近月连续3个月+5个期货月 3,5,7,9,12</td>\r\n            <td>即月及其后23个月内任何月份</td>\r\n            <td>2,4,6,8,10,12</td>\r\n            <td>1,3,5,7,9,12</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算⽅式</td>\r\n            <td>实物</td>\r\n            <td>实物</td>\r\n            <td>实物</td>\r\n            <td>现金</td>\r\n            <td>现金</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `tb_huatai_trading_market_desc` (`language_id`, `trading_market_id`, `name`, `detail`, `url`, `seo_desc`, `seo_title`, `detail2`, `seo_h1`, `other_name1`, `other_name2`, `other_name3`, `other_name4`, `other_name5`, `other_name6`, `other_detail1`, `other_detail2`, `other_detail3`, `other_detail4`, `other_detail5`, `other_detail6`, `name2`, `other2_name`, `other2_name2`, `other2_detail`, `other3_name`, `other3_name2`, `other3_name3`, `other3_name4`, `other3_name5`, `other3_name6`, `other3_name7`, `other3_name8`, `other3_detail`, `name3`) VALUES
(1, 4, 'CME Group', '<p>Equity Index</p>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>&nbsp;</th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>E-Mini Dow ($5)</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>E-Mini S&amp;P 500</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>E-Mini Nasdaq-100</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>E-Mini Russell 2000</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>Code</td>\r\n            <td>YM</td>\r\n            <td>ES</td>\r\n            <td>NQ</td>\r\n            <td>RTY</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Contract Unit</td>\r\n            <td>5USD*Index</td>\r\n            <td>50USD*Index</td>\r\n            <td>20USD*Index</td>\r\n            <td>5USD*Index</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Tick Size</td>\r\n            <td>1</td>\r\n            <td>0.25</td>\r\n            <td>0.25</td>\r\n            <td>0.1</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Price Fluctuation</td>\r\n            <td>5USD</td>\r\n            <td>12.5USD</td>\r\n            <td>5USD</td>\r\n            <td>5USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Currency</td>\r\n            <td colspan=&#34;4&#34;>USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Trading Hours</td>\r\n            <td colspan=&#34;2&#34;>06:00-04:15*, 04:30*-05:00* (04:15*-04:30* Trading Terminated)</td>\r\n            <td colspan=&#34;2&#34;>06:00-05:00* (04:15*-04:30*Trading Terminated)</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Listed Contracts</td>\r\n            <td colspan=&#34;4&#34;>3,6,9,12</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Settlement Method</td>\r\n            <td colspan=&#34;4&#34;>Financially Settled</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>The content of the product contract will be updated from time to time. For details, please refer to Exchange websites.</p>\r\n<p>Index products (ie YM, ES, NQ, RTY) all provide micro-contracts for investors to trade, and the contract size of micro-contracts is smaller and the margin is relatively low.</p>\r\n<p>&nbsp;</p>\r\n<p>FX</p>\r\n<div>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;70%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;50&#34;>&nbsp;</th>\r\n            <th width=&#34;50&#34;><span class=&#34;text_bottom_line&#34;>Australian Dollar</span></th>\r\n            <th width=&#34;50&#34;><span class=&#34;text_bottom_line&#34;>British Pound</span></th>\r\n            <th width=&#34;50&#34;><span class=&#34;text_bottom_line&#34;>Canadian Dollar</span></th>\r\n            <th width=&#34;50&#34;><span class=&#34;text_bottom_line&#34;>Euro FX</span></th>\r\n            <th width=&#34;50&#34;><span class=&#34;text_bottom_line&#34;>Japanese Yen</span></th>\r\n            <th width=&#34;50&#34;><span class=&#34;text_bottom_line&#34;>New Zealand Dollar</span></th>\r\n            <th width=&#34;50&#34;><span class=&#34;text_bottom_line&#34;>Swiss Franc</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>Code</td>\r\n            <td>AD</td>\r\n            <td>BP</td>\r\n            <td>CD</td>\r\n            <td>EC</td>\r\n            <td>JY</td>\r\n            <td>NE</td>\r\n            <td>SF</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Contract Unit</td>\r\n            <td>100,000 Australian Dollars</td>\r\n            <td>62,500 Pounds</td>\r\n            <td>100,000 Canadian Dollars</td>\r\n            <td>125,000 Euros</td>\r\n            <td>12,500,000 Yen</td>\r\n            <td>100,000 New Zealand Dollars</td>\r\n            <td>125,000 Swiss Francs</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Tick Size</td>\r\n            <td>0.00005</td>\r\n            <td>0.0001</td>\r\n            <td>0.00005</td>\r\n            <td>0.00005</td>\r\n            <td>0.0000005</td>\r\n            <td>0.0001</td>\r\n            <td>0.0001</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Price Fluctuation</td>\r\n            <td>5USD</td>\r\n            <td>6.25USD</td>\r\n            <td>5USD</td>\r\n            <td>6.25USD</td>\r\n            <td>6.25USD</td>\r\n            <td>10USD</td>\r\n            <td>12.5USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Currency</td>\r\n            <td colspan=&#34;7&#34;>USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Trading Hours</td>\r\n            <td colspan=&#34;7&#34;>06:00-05:00*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Listed Contracts</td>\r\n            <td colspan=&#34;7&#34;>3,6,9,12</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Settlement Methods</td>\r\n            <td colspan=&#34;7&#34;>Deliveralbe</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</div>', '', '', '', '<p>&nbsp;Energy</p>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34; style=&#34;width: 815px;&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>&nbsp;</th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Crude Oil</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>E-Mini Crude Oil</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Brent Last Day Financial Futures</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Henry Hub Natural Gas</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>E- Mini Natural Gas</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>Code</td>\r\n            <td>CL</td>\r\n            <td>QM</td>\r\n            <td>BZ</td>\r\n            <td>NG</td>\r\n            <td>QG</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Contract Unit</td>\r\n            <td>1000 Barrels</td>\r\n            <td>500 Barrels</td>\r\n            <td>1000 Barrels</td>\r\n            <td>10,000mmBtu</td>\r\n            <td>2,500mmBtu</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Tick Size</td>\r\n            <td>0.01</td>\r\n            <td>0.025</td>\r\n            <td>0.01</td>\r\n            <td>0.001</td>\r\n            <td>0.005</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Price Fluctuation</td>\r\n            <td>10USD</td>\r\n            <td>12.5USD</td>\r\n            <td>10USD</td>\r\n            <td>10USD</td>\r\n            <td>12.5USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Currency</td>\r\n            <td colspan=&#34;5&#34;>USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Trading Hours</td>\r\n            <td colspan=&#34;5&#34;>06:00-05:00*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Listed Contracts</td>\r\n            <td>The Recent 72 Months</td>\r\n            <td>The Recent 61 Months</td>\r\n            <td>The Remaining Months of the Year and the Upcoming 7 Years</td>\r\n            <td>The Recent 144 Months</td>\r\n            <td>The Remaining Months of the Year and the Upcoming 3 Years</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Settlement Methods</td>\r\n            <td>Deliveralbe</td>\r\n            <td>Financially Settled</td>\r\n            <td>Financially Settled</td>\r\n            <td>Deliveralbe</td>\r\n            <td>Financially Settled</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>Advantages of participating in crude oil futures trading:</p>\r\n<ul>\r\n    <li>Low bid-ask spread: After years of development, the crude oil futures market has gathered various investors and has obtained great liquidity, and the bid-ask spread of crude oil futures is relatively low. Take the US crude oil CL2020 June contract as an example. At the close of the market on April 15th, the open position of that day had reached 498,152 lots, which shows the remarkable liquidity.</li>\r\n    <li>High-leverage trading: Compared with other types of crude oil products, the margin of crude oil futures product only accounts for a small part of the contract value. The relatively lower-margin and higher-leverage makes trading and hedging activities more capital efficient.</li>\r\n    <li>Flexible trading hours: Taking the US crude oil CL contract as an example, the trading hours start at 6 a.m. and goes to 5 a.m. the next day, shows a trading period that close to 24 hours. It&rsquo;s a supplement to crude oil futures products in domestic market for investors to trade.</li>\r\n    <li>High efficiency and transparency: A robust electronic transaction and settlement system allows investors to grasp the real-time changes in the market.</li>\r\n</ul>\r\n<p>Advantages of participating in natural gas and e-mini natural gas futures trading:</p>\r\n<ul>\r\n    <li>Henry Hub natural gas is a global pricing benchmark: Henry Hub is a major natural gas storage and delivery venus in the United States, and its price is regarded as the benchmark for all US natural gas pricing. The export of U.S. natural gas continues to expand to Europe and Asia, indicating it is becoming a global benchmark of natural gas.</li>\r\n    <li>Large trading volume and high liquidity: The CME Henry Hub natural gas futures is the third largest commodity futures in terms of trading volume in the world.<span class=&#34;Apple-converted-space&#34;>&nbsp;</span></li>\r\n    <li>Large output and high demand of the underlying commodity. As the price of natural gas continues to hover at a low level in the past 10 years, superimposed on the demands of the world&#39;s major economies for clean energy, natural gas energy has advantages in replacing coal consumption. Including technological advances such as the supply of shale gas, the prospects for natural gas supply are better, thus providing an additional option of clean energy for the environmental governance of the economy represented by China as it completes the transition from industrialization to a service-oriented and technological economy.<span class=&#34;Apple-converted-space&#34;>&nbsp;</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Metals</p>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34; style=&#34;width: 815px;&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>&nbsp;</th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Gold</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Silver</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Copper</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>E-Mini Gold</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>E- Mini Silver</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>Code</td>\r\n            <td>GC</td>\r\n            <td>SI</td>\r\n            <td>HG</td>\r\n            <td>QO</td>\r\n            <td>QI</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Contract Unit</td>\r\n            <td>100 Troy Ounces</td>\r\n            <td>5,000 Troy Ounces</td>\r\n            <td>25,000 Pounds</td>\r\n            <td>50 Troy Ounces</td>\r\n            <td>2,500 Troy Ounces</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Tick Size</td>\r\n            <td>0.01</td>\r\n            <td>0.005</td>\r\n            <td>0.0005</td>\r\n            <td>0.25</td>\r\n            <td>0.0125</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Price Fluctuation</td>\r\n            <td>10USD</td>\r\n            <td>25USD</td>\r\n            <td>12.5USD</td>\r\n            <td>12.5USD</td>\r\n            <td>31.25USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Currency</td>\r\n            <td colspan=&#34;5&#34;>USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Trading Hours</td>\r\n            <td colspan=&#34;5&#34;>06:00-05:00*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Listed Contracts</td>\r\n            <td>Monthly Contracts Listed for 3 Consecutive Months, any Feb, Apr, Aug, Oct in the Nearest 23 Months and any Jun and Dec in the Nearest 72 Months</td>\r\n            <td>Monthly Contracts Listed for 3 Consecutive Months and any Jan, Mar, May, and Sep in the Nearest 23 Months and any Jul and Dec in the nearest 60 months</td>\r\n            <td>Current Month and Any Month of the Following 23 Months</td>\r\n            <td>2,4,6,8,10,12</td>\r\n            <td>1,3,5,7,9,12</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Settlement Methods</td>\r\n            <td>Deliveralbe</td>\r\n            <td>Deliveralbe</td>\r\n            <td>Deliveralbe</td>\r\n            <td>Financially Settled</td>\r\n            <td>Financially Settled</td>\r\n        </tr>\r\n    </tbody>\r\n</table>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(3, 5, '伦敦金属交易所及欧洲交易所产品', '<p>伦敦金属交易所产品</p>\r\n<p>&nbsp;</p>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>&nbsp;</th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>铝</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>铜</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>镍</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>铅</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>锡</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>锌</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>编号</td>\r\n            <td>AH<span style=&#34;white-space:pre&#34;>	</span></td>\r\n            <td>CA<span style=&#34;white-space:pre&#34;>	</span></td>\r\n            <td>NI</td>\r\n            <td>PB</td>\r\n            <td>SN</td>\r\n            <td>ZS</td>\r\n        </tr>\r\n        <tr>\r\n            <td>合约乘数</td>\r\n            <td>25吨</td>\r\n            <td>25吨</td>\r\n            <td>6吨</td>\r\n            <td>25吨</td>\r\n            <td>25吨</td>\r\n            <td>25吨</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最⼩变动价位</td>\r\n            <td>0.5</td>\r\n            <td>0.5</td>\r\n            <td>5<span style=&#34;white-space:pre&#34;>	</span></td>\r\n            <td>0.5</td>\r\n            <td>5</td>\r\n            <td>0.5</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最⼩变动价位值</td>\r\n            <td>12.5USD</td>\r\n            <td>12.5USD</td>\r\n            <td>30USD</td>\r\n            <td>&nbsp;12.5USD</td>\r\n            <td>25USD</td>\r\n            <td>12.5USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算币种</td>\r\n            <td colspan=&#34;6&#34;>USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易时间</td>\r\n            <td colspan=&#34;6&#34;>08:00-02:00*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易⽉份</td>\r\n            <td colspan=&#34;6&#34;>3个月到期</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算⽅式</td>\r\n            <td colspan=&#34;6&#34;>实物</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>特点：</p>\r\n<p>杠杆买卖</p>\r\n<p>有色金属合约以按金形式交易，而按金金额通常只占合约总值的一小部份，这种具有低按金高杠杆的特性，令买卖及对冲活动更具资本效益。</p>\r\n<p>高透明度</p>\r\n<p>伦敦金属交易所是一个高透明的市场，交易所会公布不同产品每天的价格，世界各地亦以此来厘定基础价格，以作出售或购买。</p>\r\n<p>交投活跃</p>\r\n<p>伦敦金属交易所是一个全球性及高度流动性的市场，由于交投活跃，买卖差价会相对较低，亦可避免因临近到期或差价太阔而未能平仓。</p>\r\n<p>&nbsp;</p>\r\n<p>移仓/调期 (Carry Trades)：</p>\r\n<p>移仓/调期是为了缩短或延迟交收日期，以自行平仓，当中亦会牵涉到盈亏计算。客户必须致电盘户以进行移仓/调期。</p>\r\n<p>例子:</p>\r\n<p>客户A于2017年9月3日买入1手(25吨)3个月的铜，价格为USD5890，该合约到期日为2017年12月3日。</p>\r\n<p>客户A于2017年10月5日沽出了1手(25吨)3个月的铜，价格为USD5960，该合约到期日为2018年1月5日。</p>\r\n<p>由于客户A买入和沽出的合约到期日不同(分别为2017年12月3日及2018年1月5日)，所以未能够自行平仓。</p>\r\n<p>客户A须要移仓/调期，即沽出1手(25吨)铜到期日为2017年12月3日，并买入1手(25吨)铜到期日为2018年1月5日。假设沽出的1手铜价格为USD5940，而买入的1手铜价格为USD5965，移仓/调期当中便有USD25铜价的亏损。</p>\r\n<p>移仓/调期后，才能自行平仓。</p>\r\n<p>&nbsp;</p>\r\n<p>*以上盈亏计算并未包括佣金收费</p>\r\n<p>&nbsp;</p>\r\n<p>欧洲交易所产品</p>\r\n<p>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>&nbsp;</th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>德国DAX</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>欧盟50指数</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>欧洲恐慌指数</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>欧元德国10年国债</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>编号</td>\r\n            <td>DAX</td>\r\n            <td>ESX</td>\r\n            <td>VS</td>\r\n            <td>GBL</td>\r\n        </tr>\r\n        <tr>\r\n            <td>合约乘数</td>\r\n            <td>25欧元*指数</td>\r\n            <td>10欧元*指数</td>\r\n            <td>100欧元*指数</td>\r\n            <td>100,000欧元</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最⼩变动价位</td>\r\n            <td>1</td>\r\n            <td>1</td>\r\n            <td>0.05</td>\r\n            <td>0.0001</td>\r\n        </tr>\r\n        <tr>\r\n            <td>最⼩变动价位值</td>\r\n            <td>25EUR</td>\r\n            <td>10EUR</td>\r\n            <td>5EUR</td>\r\n            <td>10EUR</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算币种</td>\r\n            <td colspan=&#34;4&#34;>EUR</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易时间</td>\r\n            <td colspan=&#34;2&#34;>08:00-04:00*</td>\r\n            <td>13:50-04:00*</td>\r\n            <td>08:00-04:00*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>交易⽉份</td>\r\n            <td colspan=&#34;2&#34;>3,6,9,12</td>\r\n            <td>九个连续月</td>\r\n            <td>3,6,9,12</td>\r\n        </tr>\r\n        <tr>\r\n            <td>结算⽅式</td>\r\n            <td colspan=&#34;3&#34;>现⾦</td>\r\n            <td>实物</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1, 5, 'LME and Eurex', '<p>LME Products</p>\r\n<p>&nbsp;</p>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>&nbsp;</th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Aluminium</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Copper</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Nickel</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Lead</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Tin</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Zinc</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>Code</td>\r\n            <td>AH</td>\r\n            <td>CA</td>\r\n            <td>NI</td>\r\n            <td>PB</td>\r\n            <td>SN</td>\r\n            <td>ZS</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Contract Size</td>\r\n            <td>25&nbsp;Tonnes</td>\r\n            <td>25&nbsp;Tonnes</td>\r\n            <td>6&nbsp;Tonnes</td>\r\n            <td>25&nbsp;Tonnes</td>\r\n            <td>25&nbsp;Tonnes</td>\r\n            <td>25&nbsp;Tonnes</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Tick Size</td>\r\n            <td>0.5</td>\r\n            <td>0.5</td>\r\n            <td>5</td>\r\n            <td>0.5</td>\r\n            <td>5</td>\r\n            <td>0.5</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Price Fluctuation</td>\r\n            <td>12.5USD</td>\r\n            <td>12.5USD</td>\r\n            <td>30USD</td>\r\n            <td>&nbsp;12.5USD</td>\r\n            <td>25USD</td>\r\n            <td>12.5USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Currency</td>\r\n            <td colspan=&#34;6&#34;>USD</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Trading Hours</td>\r\n            <td colspan=&#34;6&#34;>08:00-02:00*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Prompt Dates</td>\r\n            <td colspan=&#34;6&#34;>Out to 3 Months</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Settlement Methods</td>\r\n            <td colspan=&#34;6&#34;>Deliverable</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>Features:</p>\r\n<p>&bull;&nbsp; Leveraged trading</p>\r\n<p>The margin amount usually only accounts for a small part of the total contract value. Lower margin and higher leverage makes trading and hedging activities more capital efficient.</p>\r\n<p>&bull;&nbsp; High transparency</p>\r\n<p>LME is a highly transparent market. The exchange will release the daily prices of different products, which is a widely- recognized price benchmark to determine the basic price for sale or purchase.</p>\r\n<p>&bull;&nbsp; High liquidity</p>\r\n<p>LME provides great trading liquidity. Due to the active trading, the bid-ask spread will be relatively low, and it may also avoid the failure to close out due to the approaching expiration or the wide bid- ask spread.</p>\r\n<p>Client A bought 1 lot (25 tons) of copper with the prompt day out to 3 months on September 3, 2017 at a price of USD 5890. The contract expires on December 3, 2017.</p>\r\n<p>In addition, client A sold 1 lot (25 tons) of copper with the prompt day out to 3 months on October 5, 2017 at a price of USD 5960. The contract expires on January 5, 2018.</p>\r\n<p>Due to the different expiry dates of the contracts bought and sold by client A (respectively December 3, 2017 and January 5, 2018), the long and short position cannot close out automatically.</p>\r\n<p>Client A needs to conduct carry trade, which means selling 1 lot (25 tons) of copper with the expiry day at December 3, 2017, and buying 1 lot (25 tons) of copper with the expiry day at January 5, 2018. Suppose that the price of 1 lot of copper sold is USD5940, and the price of 1 lot of copper bought is USD5965, there will be a loss of USD25 copper price caused by the carry trade.</p>\r\n<p>*The above profit and loss calculation does not include commission fees</p>\r\n<p>&nbsp;</p>\r\n<p>EUREX Products</p>\r\n<table id=&#34;market_hkex_table&#34; width=&#34;100%&#34; cellspacing=&#34;0&#34; cellpadding=&#34;0&#34; border=&#34;0&#34;>\r\n    <tbody>\r\n        <tr>\r\n            <th width=&#34;90&#34;>&nbsp;</th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Dax</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>Euro STOXX 50 Index</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>VSTOXX</span></th>\r\n            <th width=&#34;90&#34;><span class=&#34;text_bottom_line&#34;>EURO- Bund</span></th>\r\n        </tr>\r\n        <tr>\r\n            <td>Code</td>\r\n            <td>DAX</td>\r\n            <td>ESX</td>\r\n            <td>VS</td>\r\n            <td>GBL</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Contract Size</td>\r\n            <td>25Euro* Index</td>\r\n            <td>10Euro* Index</td>\r\n            <td>100Euro* Index</td>\r\n            <td>100,000Euro</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Tick Size</td>\r\n            <td>1</td>\r\n            <td>1</td>\r\n            <td>0.05</td>\r\n            <td>0.0001</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Minimum Price Fluctuation</td>\r\n            <td>25EUR</td>\r\n            <td>10EUR</td>\r\n            <td>5EUR</td>\r\n            <td>10EUR</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Currency</td>\r\n            <td colspan=&#34;4&#34;>EUR</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Trading Hours</td>\r\n            <td colspan=&#34;2&#34;>08:00-04:00*</td>\r\n            <td>13:50-04:00*</td>\r\n            <td>08:00-04:00*</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Listed Contracts</td>\r\n            <td colspan=&#34;2&#34;>3,6,9,12</td>\r\n            <td>9 Consecutive Months</td>\r\n            <td>3,6,9,12</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Settlement Method</td>\r\n            <td colspan=&#34;3&#34;>Finacially Settled</td>\r\n            <td>Deliverable</td>\r\n        </tr>\r\n    </tbody>\r\n</table>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
