            <td>Minimum Price Fluctuation</td>\r\n            <td>11.20USD</td>\r\n            <td>5USD</td>\r\n            <td>18.75USD</td>\r\n            <td>10USD</td>\r\n            <td>10USD</td>\r\n            <td>10GBP</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Currency</td>\r\n            <td colspan=&#34;5&#34;>USD</td>\r\n            <td>GBP</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Trading Hours</td>\r\n            <td>15:30-01:00*</td>\r\n            <td>15:45-01:00*</td>\r\n            <td>16:15-01:30*</td>\r\n            <td>16:00-00:30*</td>\r\n            <td>16:45-01:30*</td>\r\n            <td>16:30-23:55</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Listed Contracts</td>\r\n            <td>3,5,7,10</td>\r\n            <td>3,5,8,10,12</td>\r\n            <td>3,5,7,9,12</td>\r\n            <td>1,3,5,7,9,11</td>\r\n            <td>3,5,7,9,12</td>\r\n            <td>3,5,7,9,12</td>\r\n        </tr>\r\n        <tr>\r\n            <td>Settlement Method</td>\r\n            <td colspan=&#34;6&#34;>Deliverable</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
