INSERT INTO `tb_huatai_trading_support_desc` (`language_id`, `trading_support_id`, `name`, `detail`, `url`, `seo_desc`, `seo_title`, `detail2`, `seo_h1`) VALUES
(3, 1, 'API接入', '<p>易盛、ATP、TT交易软件均可为客户提供程序化交易支持。关于API授权及程序化交易查询，请联络您的销售人员或电邮至sales@htfc.com.hk。<br />\r\n关于API申请的表格，请在&ldquo;<a href=&#34;http://dev1.projects-develop.com/madcradle/Huatai/sc/pas_form.php&#34;>表单下载</a>&rdquo;处下载。</p>', '', '', '', '<p>易盛、ATP、TT交易软件均可为客户提供程序化交易支持。关于API授权及程序化交易查询，请联络您的销售人员或电邮至sales@htfc.com.hk。<br />\r\n关于API申请的表格，请在&ldquo;<a href=&#34;http://dev1.projects-develop.com/madcradle/Huatai/sc/pas_form.php&#34;>表单下载</a>&rdquo;处下载。</p>', ''),
(1, 2, 'Historical & Real Market Quotations', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>Huatai provides historical and real-time market data services on various exchanges. For API trading and market data interface services, please contact your account executive or email to <span class=&#34;s1&#34; style=&#34;text-decoration-line: underline; color: rgb(0, 121, 205);&#34;>sales@htfc.com.hk</span>.</p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34; min-height:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;>For the data subscription process of Esunny trading system, please visit the &quot;<span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: Helvetica;&#34;> </span>Trading Software and Market Data Subscription&quot; page under &quot;Notices&quot;.</p>', '', '', '', '<p class=&#34;p1&#34; times=&#34; new=&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; margin: 0px; text-align: justify;&#34;>Huatai provides historical and real-time market data services on various exchanges. For API trading and market data interface services, please contact your account executive or email to&nbsp;<span class=&#34;s1&#34; style=&#34;text-decoration-line: underline; color: rgb(0, 121, 205);&#34;>sales@htfc.com.hk</span>.</p>\r\n<p class=&#34;p2&#34; times=&#34; new=&#34; min-height:=&#34; style=&#34; font-variant-numeric:=&#34;&#34; font-variant-east-asian:=&#34;&#34; font-stretch:=&#34;&#34; font-size:=&#34;&#34; line-height:=&#34;&#34; margin:=&#34;&#34; text-align:=&#34;&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; times=&#34; new=&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; margin: 0px; text-align: justify;&#34;>For the data subscription process of Esunny trading system, please visit the &quot;<span class=&#34;s2&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: Helvetica;&#34;>&nbsp;</span>Trading Software and Market Data Subscription&quot; page under &quot;Notices&quot;.</p>', ''),
(1, 1, 'API Access', '<p>Esunny, ATP, TT can provide customers with programmatic trading support. For API authorization and inquiries on programmatic transaction, please contact your account executive or email to sales@htfc.com.hk.</p>\r\n<p>Regarding the API access application form, please download it at &quot;<a href=&#34;http://dev1.projects-develop.com/madcradle/Huatai/en/pas_form.php&#34;>Forms</a>&quot;.</p>', '', '', '', '<p>Esunny, ATP, TT can provide customers with programmatic trading support. For API authorization and inquiries on programmatic transaction, please contact your account executive or email to sales@htfc.com.hk.</p>\r\n<p>Regarding the API access application form, please download it at &quot;<a href=&#34;http://dev1.projects-develop.com/madcradle/Huatai/en/pas_form.php&#34;>Forms</a>&quot;.</p>', ''),
(3, 2, '历史及实时行情数据接口', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &#34; times=&#34; new=&#34;><span style=&#34;font-size: medium; text-align: start;&#34;>本公司提供各交易所历史行情及实时行情服务。关于API交易及行情数据接口服务，请联络您的销售人员或电邮至sales@htfc.com.hk。</span><br style=&#34;font-size: medium; text-align: start;&#34; />\r\n<span style=&#34;font-size: medium; text-align: start;&#34;>关于易盛交易系统行情订阅流程，请浏览&ldquo;</span><a href=&#34;http://dev1.projects-develop.com/madcradle/Huatai/sc/news_pdf.php&#34; style=&#34;font-size: medium; text-align: start;&#34;>重要通告</a><span style=&#34;font-size: medium; text-align: start;&#34;>&rdquo;处&ldquo;行情通告&rdquo;页面。</span></p>', '', '', '', '<p>本公司提供各交易所历史行情及实时行情服务。关于API交易及行情数据接口服务，请联络您的销售人员或电邮至sales@htfc.com.hk。             <br />\r\n关于易盛交易系统行情订阅流程，请浏览&ldquo;<a href=&#34;http://dev1.projects-develop.com/madcradle/Huatai/sc/news_pdf.php&#34;>重要通告</a>&rdquo;处&ldquo;行情通告&rdquo;页面。</p>', '');
