(2, 39, '', '<p>本网站之使用条款</p>\r\n<p>在使用本网站或本网站所提供的任何在线服务之前，请阅读及了解(1) 一般条款(2) 风险披露声明及(3) 收集</p>\r\n<p>个人资料及私隐政策(统称&rdquo;条款&rdquo;)。</p>\r\n<p>&nbsp;</p>\r\n<p>阁下如登入或使用本网站，阁下即同意遵守及接受下述条款的约束。华泰（香港）期货有限公司(&ldquo;本公司&rdquo;)</p>\r\n<p>保留没有任何事先通知，而不时作出修改本使用条款的权利。当阁下使用本网站，阁下会受到条款最新版本的</p>\r\n<p>约束。如果阁下不同意这些条款，请立即停止使用本网站。</p>\r\n<p>&nbsp;</p>\r\n<p>(1) 一般条款</p>\r\n<p>&nbsp;</p>\r\n<p>网站使用</p>\r\n<p>&nbsp;</p>\r\n<p>阁下同意不可使用本网站作任何非法用途。本网站的内容仅供参考之用，在香港以外其他国家下载该等资料可</p>\r\n<p>能属违法，如阁下因下载本网站的任何资料而触犯阁下所居住国家的任何法例，本公司概不承担任何责任。</p>\r\n<p>&nbsp;</p>\r\n<p>若阁下通过本网址的连结功能离开本网址，浏览并非由本公司提供的内容，阁下应自行承担有关风险。若因该</p>\r\n<p>等网址所提供的服务、资料或其他内容有任何延误、缺失或遗漏而引致实际、声称、相应性、或受罚的亏损或</p>\r\n<p>损失，本公司概不承担任何责任。本公司对任何第三者传送的电子内容(包括但不限于其电子内容的准确性、</p>\r\n<p>主旨、质量或及时性)，概不作出任何保证或声明，亦不承担任何责任。</p>\r\n<p>&nbsp;</p>\r\n<p>非邀约招揽</p>\r\n<p>&nbsp;</p>\r\n<p>本网站所包含的资料，不应视为邀约、招揽、邀请、意见或建议购买、出售或以其他方式买卖任何投资工具或</p>\r\n<p>产品。这些资料只供一般参考，而不应为作出任何投资或业务决策的基础。本公司建议阁下在适当情况下寻求</p>\r\n<p>独立的专业意见。</p>\r\n<p>&nbsp;</p>\r\n<p>无担保承诺</p>\r\n<p>&nbsp;</p>\r\n<p>本网站的内容并不打算向用户提供买卖任何投资工具或产品之意见，或任何财务、法律、会计或税务建议，因</p>\r\n<p>此不应予以倚赖。任何指示性报价、披露资料或分析乃按本公司秉诚作出之假设及参数而编制，但不构成本公</p>\r\n<p>司建议。尽管所有资料乃本公司秉诚提供，并相信资料之来源可靠，本公司不保证任何报价、披露或分析之准</p>\r\n<p>确性、完整性或合理性。过往表现并非未来回报之保证，本公司不表示或保证任何今后将能达致的表现或回报。</p>\r\n<p>本公司并无核实所有资料，亦不保证有关资料对阁下所需用途而言乃属准确或完整，故不应加以依赖。本公司</p>\r\n<p>并无责任更新资料或改正任何其后显现之错误。本网站所载的意见、估算及其他资料可予更改或撤回，恕不预</p>\r\n<p>早通知。</p>\r\n<p>&nbsp;</p>\r\n<p>知识产权</p>\r\n<p>&nbsp;</p>\r\n<p>本网站显示的商标、商品名称、标志及提供之内容/ 资料全属本公司财产并受版权及知识产权法保护。除非阁</p>\r\n<p>下已得到本公司的事先明确书面批准，否则阁下不应向任何媒介复制、散播或发布本网站所载的资料。如果阁</p>\r\n<p>下从这个网站下载任何资料或软件，阁下同意不会复制、修改、除去、或隐藏此等资料或软件的任何部分。</p>\r\n<p>&nbsp;</p>\r\n<p>责任限制</p>\r\n<p>&nbsp;</p>\r\n<p>若因本网址出现任何失效或中断情况，或任何其他人士的行为或疏忽，导致阁下不能联通或使用网址或此等资</p>\r\n<p>料而蒙受任何直接、特殊、间接、相应或连带的损失(包括由任何第三者的行为或疏忽所导致的损失等)，即使</p>\r\n<p>本公司或任何成员事先获悉有招致此等损失的可能，本公司一概不会承担任何责任。</p>\r\n<p>&nbsp;</p>\r\n<p>违约赔偿</p>\r\n<p>&nbsp;</p>\r\n<p>若由于阁下违反本条款及细则或使用本网站或服务的关系，令本公司招致或蒙受任何损失、费用、索赔、责任、</p>\r\n<p>及支出（包括所有法律费用），阁下将作出赔偿，免令本公司及其附属董事、员工及代理人承担。</p>\r\n<p>&nbsp;</p>\r\n<p>规管法律</p>\r\n<p>&nbsp;</p>\r\n<p>本网站是受香港特别行政区法律的保护。阁下均受香港法律监管而毋须考虑法律冲突的原则，而本公司亦保留</p>\r\n<p>于任何管控阁下或阁下资产的司法管辖区进行民事诉讼或刑事法律诉讼程序的权利。本公司可在其选择的任何</p>\r\n<p>司法管辖区采取行动，阁下亦同意接受香港法院的专属管辖权。</p>\r\n<p>&nbsp;</p>\r\n<p>(2) 风险披露声明</p>\r\n<p>&nbsp;</p>\r\n<p>投资涉及风险。本网站所提及的金融投资产品的价格可升可跌，甚至变得毫无价值；过往表现不应作为将来表</p>\r\n<p>现的指引。</p>\r\n<p>&nbsp;</p>\r\n<p>本条款无意披露或讨论于本网站提及的任何金融投资产品的所有风险及其他重要信息。本网站提及的金融投资</p>\r\n<p>产品未必适合所有浏览本网站之人士，阁下必须独自承担评估风险的责任；作出任何投资决定前，阁下必须阅</p>\r\n<p>读相关之风险披露声明，阁下亦必须咨询阁下的法律、税项、财务或其他专业顾问。</p>\r\n<p>&nbsp;</p>\r\n<p>于本网站上之任何部份可能不时载有风险披露声明。若风险披露声明张贴在本网站之任何部份后或当本网站上</p>\r\n<p>载有风险披声明露时，阁下进入或使用或继续进入或使用本网站之任何部份，即阁下将被视为已阅读、明白及</p>\r\n<p>接受风险披声明露所述之条款及风险。</p>\r\n<p>&nbsp;</p>\r\n<p>基于互联网及其他电子媒介的性质，经互联网或其他电子媒介传送之讯息或进行的交易可能受干扰、传送中断、</p>\r\n<p>延迟传送、传送数据错误、数据的丢失或数据保密性的丧失；互联网及其他电子媒介的性质亦可能影响本网站</p>\r\n<p>提供的任何功能。本公司概不负责因互联网及其他电子媒介的性质或非本公司控制范围内的任何原由（包括但</p>\r\n<p>不限于通讯设施的中断或故障）而直接或间接产生或相关的任何性质的损失、损害、费用、开支、申索或责任，</p>\r\n<p>即使本公司或其任何成员事先获悉有招致此等损失的可能。</p>\r\n<p>&nbsp;</p>\r\n<p>(3) 收集个人资料及私隐政策</p>\r\n<p>&nbsp;</p>\r\n<p>基于互联网的性质，阁下透过互联网提供资料给本公司并非绝对安全。若阁下透过互联网将资料传送给本公</p>\r\n<p>司，或我们根据阁下要求而透过互联网将资料传送给阁下时出现任何错漏而令阁下蒙受损失，本公司概不负责。</p>\r\n<p>有关个人资料私隐之相关事宜，阁下请参阅客户协议书内所载之「个人资料私隐」条款。</p>\r\n<div>&nbsp;</div>', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
