p>\r\n<p>&nbsp;</p>\r\n<p>本网站是受香港特别行政区法律的保护。阁下均受香港法律监管而毋须考虑法律冲突的原则，而本公司亦保留</p>\r\n<p>于任何管控阁下或阁下资产的司法管辖区进行民事诉讼或刑事法律诉讼程序的权利。本公司可在其选择的任何</p>\r\n<p>司法管辖区采取行动，阁下亦同意接受香港法院的专属管辖权。</p>\r\n<p>&nbsp;</p>\r\n<p>(2) 风险披露声明</p>\r\n<p>&nbsp;</p>\r\n<p>投资涉及风险。本网站所提及的金融投资产品的价格可升可跌，甚至变得毫无价值；过往表现不应作为将来表</p>\r\n<p>现的指引。</p>\r\n<p>&nbsp;</p>\r\n<p>本条款无意披露或讨论于本网站提及的任何金融投资产品的所有风险及其他重要信息。本网站提及的金融投资</p>\r\n<p>产品未必适合所有浏览本网站之人士，阁下必须独自承担评估风险的责任；作出任何投资决定前，阁下必须阅</p>\r\n<p>读相关之风险披露声明，阁下亦必须咨询阁下的法律、税项、财务或其他专业顾问。</p>\r\n<p>&nbsp;</p>\r\n<p>于本网站上之任何部份可能不时载有风险披露声明。若风险披露声明张贴在本网站之任何部份后或当本网站上</p>\r\n<p>载有风险披声明露时，阁下进入或使用或继续进入或使用本网站之任何部份，即阁下将被视为已阅读、明白及</p>\r\n<p>接受风险披声明露所述之条款及风险。</p>\r\n<p>&nbsp;</p>\r\n<p>基于互联网及其他电子媒介的性质，经互联网或其他电子媒介传送之讯息或进行的交易可能受干扰、传送中断、</p>\r\n<p>延迟传送、传送数据错误、数据的丢失或数据保密性的丧失；互联网及其他电子媒介的性质亦可能影响本网站</p>\r\n<p>提供的任何功能。本公司概不负责因互联网及其他电子媒介的性质或非本公司控制范围内的任何原由（包括但</p>\r\n<p>不限于通讯设施的中断或故障）而直接或间接产生或相关的任何性质的损失、损害、费用、开支、申索或责任，</p>\r\n<p>即使本公司或其任何成员事先获悉有招致此等损失的可能。</p>\r\n<p>&nbsp;</p>\r\n<p>(3) 收集个人资料及私隐政策</p>\r\n<p>&nbsp;</p>\r\n<p>基于互联网的性质，阁下透过互联网提供资料给本公司并非绝对安全。若阁下透过互联网将资料传送给本公</p>\r\n<p>司，或我们根据阁下要求而透过互联网将资料传送给阁下时出现任何错漏而令阁下蒙受损失，本公司概不负责。</p>\r\n<p>有关个人资料私隐之相关事宜，阁下请参阅客户协议书内所载之「个人资料私隐」条款。</p>\r\n<div>&nbsp;</div>', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(3, 8, '', '<h5 class=&#34;au-title&#34;>华泰（香港）期货有限公司</h5>\r\n<p>华泰（香港）期货有限公司是华泰期货根据中国证监会批复，于2015年在香港特别行政区注册成立。于2016年9月14日，华泰（香港）期货获得香港证监会正式批核（中央编号为 BHE003），获准展开规管第2类（期货合约交易）及第5类（就期货合约提供意见）业务。华泰（香港）期货有限公司现已获得香港期货交易所交易权限，及成为香港期货交易所交易会员。华泰（香港）期货有限公司已完成大连商品交易所及郑州商品交易所境外经纪机构委托业务备案，可接受相关业务申请；同时，华泰（香港）期货有限公司为上海国际能源交易中心正式批准的首家境外特殊经纪参与者。</p>\r\n<p>华泰（香港）期货为个人、机构客户提供24小时不间断的全球市场交易服务，以专业人才团队为依托，为客户创造优质的服务，致力于境内外业务互联互通模式探索，打造中资在港期货服务机构核心竞争优势。</p>\r\n<h5 class=&#34;au-title-02&#34;>华泰期货有限公司</h5>\r\n<p>华泰期货有限公司成立于1994年3月28日，是华泰证券（股票代码：601688.SH，6886.HK）控股子公司，目前注册资本29.39亿元，主营业务为商品期货经纪、金融期货经纪、期货投资咨询、资产管理、基金销售。华泰期货是中国首批成立的期货公司之一及全国首批获得投资咨询、资产管理、风险管理子公司业务创新试点的期货公司之一，是中国期货业协会理事会会员、中国金融期货交易所全面结算会员、国内三大商品交易所会员以及上海国际能源交易中心的会员。</p>\r\n<p>华泰期货在全国设立了北京、上海、深圳、广州、成都、大连、郑州、杭州、南京9家分公司，41家营业部，同时依托华泰证券遍布全国各地的270家营业网点，形成了覆盖全国的服务网络。旗下设立风险管理子公司华泰长城资本管理有限公司、华泰长城投资管理有限公司，以及华泰长城国际贸易有限公司，华泰（香港）期货有限公司，华泰金融美国公司。</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1, 8, '', '<h5 class=&#34;au-title&#34;>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: 400; font-stretch: normal; font-size: 10px; line-height: normal; font-family: &#34; times=&#34; new=&#34;><span style=&#34;font-size: 18px;&#34;><span times=&#34; new=&#34;>Huatai (Hong Kong) Futures Ltd.&nbsp;</span></span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: 400; font-stretch: normal; font-size: 10px; line-height: normal; font-family: &#34; times=&#34; new=&#34;><span style=&#34;font-size: 14px;&#34;><span times=&#34; new=&#34;>Huatai (Hong Kong) Futures Ltd. (&ldquo;the Company&rdquo;) was established by Huatai Futures Co., Ltd in Hong Kong SAR in 2015, according to the approval of China Securities and Regulatory Committee (&ldquo;CSRC&rdquo;). The Company obtained the license by the Securities and Futures Commission (&ldquo;SFC&rdquo;) in Sep 14, 2016, for conducting regulated activities, namely type 2 dealing in futures contracts and type 5 advising on futures contracts. The CE Number is BHE003.&nbsp;</span></span><span style=&#34;font-size: 14px;&#34;><span times=&#34; new=&#34;>The Company has now obtained the trading right of the Hong Kong Futures Exchange and has become a trading participant of the Hong Kong Futures Exchange. The Company has completed the registration of the entrusted business of the Dalian Commodity Exchange and Zhengzhou Commodity Exchange&rsquo;s as an Overseas Intermediary, and is entitled to conduct relevant business. At the same time, the Company is the first Overseas Special Brokerage Participant that formally approved by the Shanghai International Energy Exchange.</span></span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: 400; font-stretch: normal; font-size: 10px; line-height: normal; font-family: &#34; times=&#34; new=&#34;><span style=&#34;font-size: 14px;&#34;><br />\r\n</span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: 400; font-stretch: normal; font-size: 10px; line-height: normal; font-family: &#34; times=&#34; new=&#34;><span style=&#34;font-size: 14px;&#34;><span times=&#34; new=&#34;>The Company provides 24h services in dealing in futures contracts covering global markets for both individual and institutional clients. The Company aims to build its competitive advantages in futures dealing services and explores to establish a linkage mechanism between domestic and oversea market. High quality service is provided by our professional team.</span></span><span style=&#34;font-size: 16px;&#34;><br type=&#34;_moz&#34; />\r\n</span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: 400; font-stretch: normal; font-size: 10px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: 400; font-stretch: normal; font-size: 10px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: 400; font-stretch: normal; font-size: 10px; line-height: normal; font-family: &#34; times=&#34; new=&#34;>&nbsp;</p>\r\n<span style=&#34;font-size: 16px;&#34;>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: 400; font-stretch: normal; font-size: 10px; line-height: normal; font-family: &#34; times=&#34; new=&#34;><span style=&#34;font-size: 18px;&#34;><span times=&#34; new=&#34;><span lang=&#34;EN-US&#34;>Huatai Futures Co., Ltd.</span></span></span></p>\r\n</span>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: 400; font-stretch: normal; font-size: 10px; line-height: normal; font-family: &#34; times=&#34; new=&#34;><span style=&#34;font-size: 14px;&#34;>Huatai Futures Co., Ltd. (&ldquo;Huatai Futures&rdquo;) was established on March 28<sup>th</sup>, 1994. As a subsidiary of Huatai Securities (stock code: 601688.SH, 6886.HK), Huatai Futures has registered capital of 2.939 billion RMB with major business scoped in commodity and financial futures brokerage, futures investment consultancy, asset management and fund selling.<span class=&#34;s1&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica;&#34;> </span>Huatai futures is one of the first batch of futures commission merchants (&ldquo;FCM&rdquo;) in China and one of pilot FCMs approved for innovative business operations in futures investment consultancy, asset management and risk management.<span class=&#34;s1&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica;&#34;> </span>Huatai Futures is the member of the China Futures Association (&ldquo;CFA&rdquo;) council, the comprehensive clearing member of China Financial Futures Exchange (&ldquo;CFFEX&rdquo;), the member of Shanghai International Energy Exchange and the member of three commodity futures exchanges in China: Shanghai Futures Exchange (&ldquo;SHFE&rdquo;), Dalian Commodity Exchange (&ldquo;DCE&rdquo;) and Zhengzhou Commodity Exchange (&ldquo;ZCE&rdquo;).<span class=&#34;Apple-converted-space&#34;>&nbsp;</span></span></p>\r\n<p class=&#34;p2&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: 400; font-stretch: normal; font-size: 10px; line-height: normal; font-family: &#34; times=&#34; new=&#34; min-height:=&#34;&gt;&lt;span style=&#34; font-size:=&#34;&gt;&nbsp;&lt;/p&gt;&#10;&lt;p class=&#34;><span style=&#34;font-size: 14px;&#34;>Huatai Futures has set up 9 branches in Beijing, Shanghai, Shenzhen, Guangzhou, Chengdu, Dalian, Zhengzhou, Hangzhou and Nanjing and has set 41 business divisions nationwide. Huatai Futures has established its nationwide IB network, supported by Huatai Securities&rsquo; more than 270 business divisions throughout the country.<span class=&#34;s1&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica;&#34;> </span>Huatai Futures affiliates Huatai Great Wall Capital Management Co. Ltd., Huatai Great Wall Investment Management Co. Ltd., Huatai Great Wall International Trade Co., Ltd., Huatai (Hong Kong) Futures Ltd., and Huatai Financial USA. Inc..</span></p>\r\n</h5>', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
