(1, 52, '', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;;&#34;>The following margin standards will be adjusted according to the requirements of the exchange or company, and are for reference only. Please refer to the latest daily statement for actual margin values.</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
