(1, 9, '', '<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;;&#34;><span style=&#34;font-size: 14px;&#34;>Huatai Securities Co., Ltd. (&quot;Huatai Securities&quot; or &quot;Company&quot;) is a leading technology-driven comprehensive securities group. Since its establishment in 1991, Huatai Securities has actively seized the historical opportunity of China&#39;s capital market reform and opening up, and has taken the lead in the industry to facilitate the transformation through financial technology, developing a full business chain service system to provide professional and diversified securities financial services to individual and institutional clients. With comprehensive strength and strong brand influence, Huatai Securities ranks top in the domestic securities industry, and is entering a new stage of international development.</span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;;&#34;><span style=&#34;font-size: 14px;&#34;><br type=&#34;_moz&#34; />\r\n</span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;;&#34;><span style=&#34;font-size: 14px;&#34;>On February 26, 2010, the company&#39;s A shares (601688: CH) were listed and traded on the Shanghai Stock Exchange. On June 1, 2015, the company&#39;s H shares (6886: HK) were listed and traded on the Hong Kong Stock Exchange. On June 17, 2019, the company&#39;s Global Depository Receipts (HTSC:LI) was successfully listed and traded on the London Stock Exchange, becoming the first Chinese company to land on the London Stock Exchange under the Shanghai-London Stock Connect business mechanism. Since then, the company has also become a Chinese financial institution listed in Shanghai, Hong Kong and London.</span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;;&#34;><span style=&#34;font-size: 14px;&#34;><br type=&#34;_moz&#34; />\r\n</span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;;&#34;><span style=&#34;font-size: 14px;&#34;>Relying on a highly coordinated business model, advanced digital platform, and extensive and close client relationship, the company&#39;s wealth management business, institutional service business, investment management business and international business has developed in an all- round way, ranked among the top in the industry, and strive to create a differentiated core advantage and competitive strength for the future. Since 2014, the Company&#39;s stock and fund trading volume has ranked top the industry (according to Shanghai and Shenzhen Stock Exchange data); the mobile wealth management app &quot;Zhangle Fortune Link&quot; developed by the Company has also ranked top in the industry for a long time in terms of monthly active users, as of July 2020 More than 10 million per month (according to Analysys data). As of June 30, 2020, the cumulative number of downloads exceeded 50 million. In 2019, the amount of mergers and acquisitions in which the Company has participated approved by the China Securities Regulatory Commission ranked top in the industry (according to the statistics published by the China Securities Regulatory Commission).</span></p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;;&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;;&#34;>Currently, the Company have 4 wholly owned subsidiaries including Huatai Financial Holdings(Hong Kong) Limited, Huatai Zijin Investment Co., Ltd., Huatai Innovation Investment Co., Ltd., and Huatai Securities (Shanghai) Asset Management Co., Ltd.<span class=&#34;s1&#34; style=&#34;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica;&#34;> </span>The Company has controlling interests in 3 subsidiaries including Huatai United Securities Co., Ltd., Huatai Futures Co.,Ltd., and Jiangsu Equity Exchange Co., Ltd. The Company also have interests in China Southern Asset Management Co., Ltd., Huatai-Pine Bridge Fund Management Co., Ltd., Bank of Jiangsu Co., Ltd., etc. In 2016, the company acquired AssetMark, the third largest company in the US TAMP (turnkey asset management platform) industry, and completed its first overseas strategic acquisition. In July 2019, AssetMark was listed and traded on the New York Stock Exchange.</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: normal; font-family: &quot;Times New Roman&quot;;&#34;>&nbsp;</p>\r\n<p class=&#34;p1&#34; style=&#34;margin: 0px; text-align: justify; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: &quot;Times New Roman&quot;;&#34;><span style=&#34;font-size: 14px;&#34;>Adhering to the core values ​​of &quot;Efficiency, Integrity, Stability, and Innovation&quot;, the Company will fully implement the &quot;two-wheel drive&quot; development strategy of wealth management and institutional services empowered by digitalization, and strive to become a first-class integrated financial group with both local advantages and global influence.</span></p>\r\n<p>&nbsp;</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(2, 9, '', '<p>华泰证券股份有限公司（&ldquo;华泰证券&rdquo;或&ldquo;公司&rdquo;）是一家领先的科技驱动型综合证券集团。自1991年成立以来，华泰证券积极把握中国资本市场改革开放的历史机遇，在业内率先以金融科技助力转型，用全业务链服务体系为个人和机构客户提供专业、多元的证券金融服务，综合实力和品牌影响力位居国内证券业第一方阵，步入国际化发展的全新阶段。</p>\r\n<p>2010年2月26日，公司A股（601688:CH）在上海证券交易所挂牌上市交易。2015年6月1日，公司H股（6886:HK）在香港联合交易所挂牌上市交易。2019年6月17日，公司全球存托凭证（HTSC:LI）在伦敦证券交易所成功上市交易，成为首家按沪伦通业务机制登陆伦交所的中国公司。自此，公司也成为一家在上海、香港和伦敦三地上市的中国金融机构。</p>\r\n<p>依托高度协同的业务模式、先进的数字化平台、广泛且紧密的客户资源，公司财富管理业务、机构服务业务、投资管理业务和国际业务全方位发展，全力打造面向未来的差异化核心优势，竞争实力位居行业前列。2014年以来，公司股票基金交易量保持行业第一（据沪深交易所数据）；公司移动财富管理APP&ldquo;涨乐财富通&rdquo;月度活跃用户数也长期名列行业APP第一，截至2020年7月超过1000万（据易观数据），截至2020年6月30日累计下载量超过5,000万；2019年，经证监会核准的并购重组交易金额居行业首位（据证监会公开信息统计）。</p>\r\n<p>公司拥有全资子公司华泰证券（上海）资产管理有限公司、华泰国际金融控股有限公司、华泰紫金投资有限责任公司、华泰创新投资有限公司；控股子公司华泰联合证券有限责任公司、华泰期货有限公司、江苏股权交易中心有限责任公司；参股南方基金管理有限公司、华泰柏瑞基金管理有限公司、江苏银行股份有限公司等。2016年，公司收购美国TAMP（统包资产管理平台）行业的第三大公司AssetMark，完成首次境外战略收购。2019年7月，AssetMark在纽约证券交易所挂牌上市交易。</p>\r\n<p>秉承&ldquo;高效、诚信、稳健、创新&rdquo;的核心价值观，华泰证券将全面实施数字化赋能下的财富管理和机构服务&ldquo;双轮驱动&rdquo;发展战略，致力成为兼具本土优势和全球影响力的一流综合金融集团。</p>\r\n<p>&nbsp;</p>', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
